insert into TB_INVESTIMENTO (ID,PID_TIPO_INVESTIMENTO,PID_RISCO_PRE_FORMAT,PID_TIPO_RISCO,PID_PRODUTO,PID_EMPRESA,NM_INVESTIMENTO, CD_FUNDO_SEG,DS_RESUMO,FL_MAIOR_VENDA,FL_APORTE_OBRIG,FL_CONTRIB_OBRIG,FL_VISAO_CLIENTE,FL_ATIVO,VL_APORTE, VL_CONTRIBUICAO,COR)values(         22991,          1,           null,          null,          6,         4,         'ABSOLUTE ICATU I PREV FIC FIM',          'ABPRE',          'Fundo com gestão da Absolute Investimentos que busca retornos consistentes através de uma filosofia de investimentos não-dogmática que combina: Contraposição do cenário macro com o “técnico” de mercado, reavaliação constante do risco-retorno da operação e política disciplinada de stop-loss. Esse produto tem mesmo estilo de gestão e mesmo horizonte de investimento dos fundos macro CVM 555 da Absolute e atua nos mercados de juros, câmbio e bolsa.',          null,       'S' ,         'S' ,          'S',          'S',          '30000,00'      ,            null     ,      null          );
