insert into TB_INVESTIMENTO (ID,PID_TIPO_INVESTIMENTO,PID_RISCO_PRE_FORMAT,PID_TIPO_RISCO,PID_PRODUTO,PID_EMPRESA,NM_INVESTIMENTO, CD_FUNDO_SEG,DS_RESUMO,FL_MAIOR_VENDA,FL_APORTE_OBRIG,FL_CONTRIB_OBRIG,FL_VISAO_CLIENTE,FL_ATIVO,VL_APORTE, VL_CONTRIBUICAO,COR)values(         574,          1,           null,          null,          6,         4,         'ICATU SEG ABSOLUTO FI PREV RF CP',          'ABSOL',          'Fundo de previdência de crédito privado gerido pela Icatu Vanguarda. A casa se caracteriza pela gestão conservadora de crédito com longo histórico sem nenhum caso de default e por ter uma equipe experiente. A Vanguarda é focada na gestão, não distribui ou origina qualquer ativo de crédito, e realiza análise própria dos seus investimentos que conta com bureau de análise de crédito próprio atuante há mais de dez anos, que segue parâmetros de avaliação definidos pelo board da Icatu Seguros. É um fundo de crédito de volatilidade baixíssima.',          null,       'S' ,         'S' ,          'S',          'S',          '10000,00'      ,            '800,00'     ,      null          );
insert into TB_INVESTIMENTO (ID,PID_TIPO_INVESTIMENTO,PID_RISCO_PRE_FORMAT,PID_TIPO_RISCO,PID_PRODUTO,PID_EMPRESA,NM_INVESTIMENTO, CD_FUNDO_SEG,DS_RESUMO,FL_MAIOR_VENDA,FL_APORTE_OBRIG,FL_CONTRIB_OBRIG,FL_VISAO_CLIENTE,FL_ATIVO,VL_APORTE, VL_CONTRIBUICAO,COR)values(         607,          1,           null,          null,          6,         4,         'VINCI EQUILÍBRIO ICATU PREV FIC FIM II',          'VIN2',          'Fundo multimercado gerido pela Vinci. O fundo aloca recursos nas seguintes estratégias: renda fixa – pós-fixado, renda fixa – inflação curta e renda variável – dividendos. A gestora possui bom histórico na estratégia de dividendos cujo objetivo é realizar investimentos em empresas de bons retornos de longo prazo e com baixa volatilidade. Tais empresas, em geral, são maduras, com baixo risco de negócio, baixo risco de projeção, geram lucros e têm baixa necessidade de re-investimento. Além disso, possuem sustentável geração de caixa e de distribuição de resultados e também possuem boa proteção contra inflação.',          null,       'S' ,         'S' ,          'S',          'S',          '5000,00'      ,            '300,00'     ,      null          );
insert into TB_INVESTIMENTO (ID,PID_TIPO_INVESTIMENTO,PID_RISCO_PRE_FORMAT,PID_TIPO_RISCO,PID_PRODUTO,PID_EMPRESA,NM_INVESTIMENTO, CD_FUNDO_SEG,DS_RESUMO,FL_MAIOR_VENDA,FL_APORTE_OBRIG,FL_CONTRIB_OBRIG,FL_VISAO_CLIENTE,FL_ATIVO,VL_APORTE, VL_CONTRIBUICAO,COR)values(         516,          1,           null,          null,          5,         4,         'DLM ICATU SEG PREVIDÊNCIA FIM CP',          'DLM',          'Fundo multimercado gerido pela DLM Invista. O fundo busca proporcionar ganhos de capital superiores ao rendimento do CDI investindo em uma carteira composta preponderantemente de crédito privado de alta qualidade. A estratégia atual do fundo é preponderam ente de renda fixa sem exposição a moedas ou renda variável.',          null,       'S' ,         'S' ,          'S',          'S',          '5000,00'      ,            '300,00'     ,      null          );
insert into TB_INVESTIMENTO (ID,PID_TIPO_INVESTIMENTO,PID_RISCO_PRE_FORMAT,PID_TIPO_RISCO,PID_PRODUTO,PID_EMPRESA,NM_INVESTIMENTO, CD_FUNDO_SEG,DS_RESUMO,FL_MAIOR_VENDA,FL_APORTE_OBRIG,FL_CONTRIB_OBRIG,FL_VISAO_CLIENTE,FL_ATIVO,VL_APORTE, VL_CONTRIBUICAO,COR)values(         563,          1,           null,          null,          6,         4,         'ATHENA ICATU PREV FIM 49',          'ATENA',          'Fundo de previdência multimercado gerido pela Athena Capital. O fundo investe basicamente em títulos públicos de baixo risco e renda variável. A parcela de renda variável adota como filosofia de investimento uma análise fundamentalista, amparada majoritariamente por análises e observações feitas diretamente na economia real. O fundo possui por objetivo proporcionar ganhos absolutos e consistentes a médio e longo prazo, sem perseguir correlação com qualquer índice de Bolsa. A parcela de renda variável do fundo fica predominantemente comprada em ações, mas pode, eventualmente, ter posições vendidas para ganho absoluto. Pode alocar até 49% de seu PL em renda variável.',          null,       'S' ,         'S' ,          'S',          'S',          '5000,00'      ,            '300,00'     ,      null          );
insert into TB_INVESTIMENTO (ID,PID_TIPO_INVESTIMENTO,PID_RISCO_PRE_FORMAT,PID_TIPO_RISCO,PID_PRODUTO,PID_EMPRESA,NM_INVESTIMENTO, CD_FUNDO_SEG,DS_RESUMO,FL_MAIOR_VENDA,FL_APORTE_OBRIG,FL_CONTRIB_OBRIG,FL_VISAO_CLIENTE,FL_ATIVO,VL_APORTE, VL_CONTRIBUICAO,COR)values(         589,          1,           null,          null,          6,         4,         'ICATU SEG GLOBAL EQUITY INCOME 10 FI MUL',          'GLOBA',          'O fundo nasceu da parceria entre a Icatu Seguros e BlackRock. O fundo investe em uma carteira diversificada composta por títulos atrelados à inflação com vencimento inferior a 5 anos e de ações globais de alta qualidade (até 10% do PL). A gestão do fundo fica a cargo da Icatu Vanguarda que faz a alocação da parte de renda fixa brasileira e investe, via veículos locais, em uma estratégia de ações globais da BlackRock. A diversificação é o grande diferencial do produto, a estratégia gerida pela BlackRock oferece uma diversificação geográfica e setorial muito mais ampla que o investimento em renda variável local. Além disso, a alocação em ativos atrelados a índice de preços proporciona ganho real e proteção contra a inflação. Fatores que tornam o fundo atrativo para investimento de longo prazo.',          null,       'S' ,         'S' ,          'S',          'S',          '5000,00'      ,            '300,00'     ,      null          );
insert into TB_INVESTIMENTO (ID,PID_TIPO_INVESTIMENTO,PID_RISCO_PRE_FORMAT,PID_TIPO_RISCO,PID_PRODUTO,PID_EMPRESA,NM_INVESTIMENTO, CD_FUNDO_SEG,DS_RESUMO,FL_MAIOR_VENDA,FL_APORTE_OBRIG,FL_CONTRIB_OBRIG,FL_VISAO_CLIENTE,FL_ATIVO,VL_APORTE, VL_CONTRIBUICAO,COR)values(         553,          1,           null,          null,          5,         4,         'ALASKA 70 ICATU PREV FIM',          'ALASK',          'O ALASKA 70 ICATU PREV FIM é um fundo gerido pela Alaska Asset Management. Trata-se de um fundo multimercado no qual 70% do seu PL é alocado em uma estratégia de renda variável e o restante alocado em renda fixa. O objetivo do fundo é investir em empresas de qualidade, administradas por pessoas competentes e confiáveis e obter retorno sobre o capital do fundo através da geração de caixa das empresas investidas.',          null,       'S' ,         'S' ,          'S',          'S',          '5000,00'      ,            '300,00'     ,      null          );
insert into TB_INVESTIMENTO (ID,PID_TIPO_INVESTIMENTO,PID_RISCO_PRE_FORMAT,PID_TIPO_RISCO,PID_PRODUTO,PID_EMPRESA,NM_INVESTIMENTO, CD_FUNDO_SEG,DS_RESUMO,FL_MAIOR_VENDA,FL_APORTE_OBRIG,FL_CONTRIB_OBRIG,FL_VISAO_CLIENTE,FL_ATIVO,VL_APORTE, VL_CONTRIBUICAO,COR)values(         23427,          1,           null,          null,          6,         4,         'INDIE ICATU PREVIDÊNCIA FIM',          'INDIE',          'Trata-se de um fundo previdenciário multimercado que pode investir até 70% de seu PL em ações. O processo de investimento foca em empresas brasileiras com assimetria de risco e retorno e evita riscos binários.',          null,       'S' ,         'S' ,          'S',          'S',          '5000,00'      ,            '300,00'     ,      null          );
insert into TB_INVESTIMENTO (ID,PID_TIPO_INVESTIMENTO,PID_RISCO_PRE_FORMAT,PID_TIPO_RISCO,PID_PRODUTO,PID_EMPRESA,NM_INVESTIMENTO, CD_FUNDO_SEG,DS_RESUMO,FL_MAIOR_VENDA,FL_APORTE_OBRIG,FL_CONTRIB_OBRIG,FL_VISAO_CLIENTE,FL_ATIVO,VL_APORTE, VL_CONTRIBUICAO,COR)values(         23425,          1,           null,          null,          6,         4,         'CONSTELLATION ICATU 70 PREV FIM',          'CON70',          'Fundo de previdência com gestão da Constellation Asset Management. Trata-se de um fundo previdenciário multimercado no qual 70% do seu PL é alocado na estratégia de renda variável da Constellation e o restante alocado em títulos de renda fixa. A filosofia de investimento da gestora baseia-se em estar próximo às empresas como um "friendly advisor", evitar a perda permanente de capital e concentrações indesejadas em certos fatores de risco e entender em detalhe as indústrias, os negócios, a gestão e a dinâmica particular de cada empresa que investe. A gestora procura manter um portfólio balanceado e suas posições ficam no portfólio em média 3 anos.',          null,       'S' ,         'S' ,          'S',          'S',          '5000,00'      ,            '300,00'     ,      null          );
