insert into TB_INVESTIMENTO (ID,PID_TIPO_INVESTIMENTO,PID_RISCO_PRE_FORMAT,PID_TIPO_RISCO,PID_PRODUTO,PID_EMPRESA,NM_INVESTIMENTO, CD_FUNDO_SEG,DS_RESUMO,FL_MAIOR_VENDA,FL_APORTE_OBRIG,FL_CONTRIB_OBRIG,FL_VISAO_CLIENTE,FL_ATIVO,VL_APORTE, VL_CONTRIBUICAO,COR)values(         525,          1,           null,          null,          5,         4,         'ICATU SEG COMPOSTO 49E FIC FIM',          'PGE49',          'Fundo de previdência balanceado gerido pela Icatu Vanguarda. O fundo balanceado é um tipo particular de multimercado que investe somente em renda variável e renda fixa em uma proporção definida. O fundo se caracteriza por ter uma parcela de renda variável que busca replicar a rentabilidade do Ibovespa e ter uma parcela de renda fixa com gestão ativa. Pode aplicar até 49% em renda variável.',          null,       'S' ,         'S' ,          'S',          'S',          '1000,00'      ,            '100,00'     ,      null          );
insert into TB_INVESTIMENTO (ID,PID_TIPO_INVESTIMENTO,PID_RISCO_PRE_FORMAT,PID_TIPO_RISCO,PID_PRODUTO,PID_EMPRESA,NM_INVESTIMENTO, CD_FUNDO_SEG,DS_RESUMO,FL_MAIOR_VENDA,FL_APORTE_OBRIG,FL_CONTRIB_OBRIG,FL_VISAO_CLIENTE,FL_ATIVO,VL_APORTE, VL_CONTRIBUICAO,COR)values(         538,          1,           null,          null,          5,         4,         'IS MINHA APOSENTADORIA 2030 FIC FIM',          'MAP03',          'Fundo data-alvo gerido pela Icatu Vanguarda. O fundo tenta replicar o ciclo de vida de um cliente que se torna mais conservador a medida que se aproxima da sua data aposentadoria, da mesma forma, o fundo vai diminuindo a sua volatilidade conforme se aproxima da data-alvo. A estratégia é dinâmica e não há necessidade, por parte do cliente, de readequar a sua carteira por grau de risco ou fazer revisões periódicas.',          null,       'S' ,         'S' ,          'S',          'S',          '1000,00'      ,            '100,00'     ,      null          );
