insert into TB_INVESTIMENTO (ID,PID_TIPO_INVESTIMENTO,PID_RISCO_PRE_FORMAT,PID_TIPO_RISCO,PID_PRODUTO,PID_EMPRESA,NM_INVESTIMENTO, CD_FUNDO_SEG,DS_RESUMO,FL_MAIOR_VENDA,FL_APORTE_OBRIG,FL_CONTRIB_OBRIG,FL_VISAO_CLIENTE,FL_ATIVO,VL_APORTE, VL_CONTRIBUICAO,COR)values(         548,          1,           null,          null,          5,         4,         'LEBLON PREVIDÊNCIA FIM',          'LEB01',          'Fundo de previdência multimercado gerido pela Leblon Equities. O objetivo do fundo é atingir elevados retornos absolutos no longo prazo através de uma gestão ativa de investimentos realizados predominantemente nos mercados brasileiros de ações e de renda fixa. O fundo investe até 49% de sua carteira em ações com alto potencial de valorização no longo prazo. O restante da carteira é investido predominantemente em títulos públicos federais.',          null,       'S' ,         'S' ,          'S',          'S',          '5000,00'      ,            '300,00'     ,      null          );
insert into TB_INVESTIMENTO (ID,PID_TIPO_INVESTIMENTO,PID_RISCO_PRE_FORMAT,PID_TIPO_RISCO,PID_PRODUTO,PID_EMPRESA,NM_INVESTIMENTO, CD_FUNDO_SEG,DS_RESUMO,FL_MAIOR_VENDA,FL_APORTE_OBRIG,FL_CONTRIB_OBRIG,FL_VISAO_CLIENTE,FL_ATIVO,VL_APORTE, VL_CONTRIBUICAO,COR)values(         568,          1,           null,          null,          6,         4,         'OCCAM ICATU PREV FIC FIM',          'PLURA',          'Fundo de previdência multimercado gerido pela Occam Brasil. O OCCAM ICATU PREV FIM busca alocar, em condições normais de mercado, dois terços do risco em estratégias de renda variável (long/short) e um terço do risco em estratégias de juros/inflação/câmbio, respeitando as regras da legislação vigente para as Entidades Abertas de Previdência.',          null,       'S' ,         'S' ,          'S',          'S',          '5000,00'      ,            '300,00'     ,      null          );
insert into TB_INVESTIMENTO (ID,PID_TIPO_INVESTIMENTO,PID_RISCO_PRE_FORMAT,PID_TIPO_RISCO,PID_PRODUTO,PID_EMPRESA,NM_INVESTIMENTO, CD_FUNDO_SEG,DS_RESUMO,FL_MAIOR_VENDA,FL_APORTE_OBRIG,FL_CONTRIB_OBRIG,FL_VISAO_CLIENTE,FL_ATIVO,VL_APORTE, VL_CONTRIBUICAO,COR)values(         573,          1,           null,          null,          6,         4,         'IBIUNA PREV ICATU FIC FIM',          'IBIUN',          'A Ibiuna Investimentos foi fundada em maio de 2010, com o objetivo de gerar retornos ao longo de longo prazo aos seus clientes. Possui sólida equipe de profissionais seniores, com larga experiência nos mercados local e internacional, liderada por Mário Torós, Rodrigo Azevedo e André Lion. O IBIUNA PREV ICATU FIC FIM é um fundo de previdência multimercado com enfoque macro “top down” que objetiva proporcionar aos seus cotistas ganhos de capital no longo prazo. O fundo busca oportunidades nos mercados de juros, moedas e renda variável. Foi um dos primeiros fundos de previdência multimercado, o fundo existe desde 2013.',          null,       'S' ,         'S' ,          'S',          'S',          '5000,00'      ,            '300,00'     ,      null          );
insert into TB_INVESTIMENTO (ID,PID_TIPO_INVESTIMENTO,PID_RISCO_PRE_FORMAT,PID_TIPO_RISCO,PID_PRODUTO,PID_EMPRESA,NM_INVESTIMENTO, CD_FUNDO_SEG,DS_RESUMO,FL_MAIOR_VENDA,FL_APORTE_OBRIG,FL_CONTRIB_OBRIG,FL_VISAO_CLIENTE,FL_ATIVO,VL_APORTE, VL_CONTRIBUICAO,COR)values(         504,          1,           null,          null,          5,         4,         'APEX LONG BIASED ICATU PREV FIM',          'APEXM',          'Fundo de previdência gerido pela Apex Capital. O APEX LONG BIASED ICATU PREV FIM 49 foi o primeiro fundo de previdência com estratégia de investimento Long Biased. A estratégia consiste no conceito de que não é preciso que a totalidade do patrimônio de renda variável esteja em posição comprada para alcançar a valorização superior ao índice. O fundo se beneficia da queda dos preços das ações na parcela vendida e a diversificação entre as posições resulta em uma menor volatilidade. O PL restante do fundo é alocado em títulos públicos pós-fixados e indexados ao IPCA. Pode alocar até 49% de seu PL em renda variável.',          null,       'S' ,         'S' ,          'S',          'N',          '5000,00'      ,            '300,00'     ,      null          );
insert into TB_INVESTIMENTO (ID,PID_TIPO_INVESTIMENTO,PID_RISCO_PRE_FORMAT,PID_TIPO_RISCO,PID_PRODUTO,PID_EMPRESA,NM_INVESTIMENTO, CD_FUNDO_SEG,DS_RESUMO,FL_MAIOR_VENDA,FL_APORTE_OBRIG,FL_CONTRIB_OBRIG,FL_VISAO_CLIENTE,FL_ATIVO,VL_APORTE, VL_CONTRIBUICAO,COR)values(         510,          1,           null,          null,          5,         4,         'BNP PARIBAS ICATU SEG FI RF PREV CP',          'BNPPA',          'Fundo de previdência de crédito privado gerido pela BNP Paribas Asset Management. O Fundo tem por objetivo acompanhar a variação do CDI investindo preponderantemente em títulos públicos e privados atrelados direta ou indiretamente ao CDI.',          null,       'S' ,         'S' ,          'S',          'S',          '30000,00'      ,            null     ,      null          );
insert into TB_INVESTIMENTO (ID,PID_TIPO_INVESTIMENTO,PID_RISCO_PRE_FORMAT,PID_TIPO_RISCO,PID_PRODUTO,PID_EMPRESA,NM_INVESTIMENTO, CD_FUNDO_SEG,DS_RESUMO,FL_MAIOR_VENDA,FL_APORTE_OBRIG,FL_CONTRIB_OBRIG,FL_VISAO_CLIENTE,FL_ATIVO,VL_APORTE, VL_CONTRIBUICAO,COR)values(         566,          1,           null,          null,          6,         4,         'BNP PARIBAS ICATU SEG FI RF PREV CP',          'BNPPA',          'Fundo de previdência de crédito privado gerido pela BNP Paribas Asset Management. O Fundo tem por objetivo acompanhar a variação do CDI investindo preponderantemente em títulos públicos e privados atrelados direta ou indiretamente ao CDI.',          null,       'S' ,         'S' ,          'S',          'S',          '30000,00'      ,            null     ,      null          );
insert into TB_INVESTIMENTO (ID,PID_TIPO_INVESTIMENTO,PID_RISCO_PRE_FORMAT,PID_TIPO_RISCO,PID_PRODUTO,PID_EMPRESA,NM_INVESTIMENTO, CD_FUNDO_SEG,DS_RESUMO,FL_MAIOR_VENDA,FL_APORTE_OBRIG,FL_CONTRIB_OBRIG,FL_VISAO_CLIENTE,FL_ATIVO,VL_APORTE, VL_CONTRIBUICAO,COR)values(         557,          1,           null,          null,          5,         4,         'WESTERN ASSET ICATU RF ATIVO PREV FIC FI',          'WEPRE',          'Fundo de renda fixa com gestão da Western Asset. O fundo tem por objetivo proporcionar rentabilidade através das oportunidades oferecidas pelos mercados domésticos de taxa de juros pré-fixadas, taxas de juros de um dia praticadas no mercado interbancário e índices de preço, excluindo estratégias que impliquem risco de moeda estrangeira ou de renda variável. Para a realização do objetivo do Fundo, o gestor buscará primordialmente aumentar ou diminuir, conforme o caso, a exposição do Fundo ao mercado de taxas de juros, procurando, conforme o caso, obter ganhos adicionais ou limitar perdas para a carteira.',          null,       'S' ,         'S' ,          'S',          'S',          '30000,00'      ,            null     ,      null          );
insert into TB_INVESTIMENTO (ID,PID_TIPO_INVESTIMENTO,PID_RISCO_PRE_FORMAT,PID_TIPO_RISCO,PID_PRODUTO,PID_EMPRESA,NM_INVESTIMENTO, CD_FUNDO_SEG,DS_RESUMO,FL_MAIOR_VENDA,FL_APORTE_OBRIG,FL_CONTRIB_OBRIG,FL_VISAO_CLIENTE,FL_ATIVO,VL_APORTE, VL_CONTRIBUICAO,COR)values(         535,          1,           null,          null,          5,         4,         'ICATU SEG INSIGNE FIC FI RF CP',          'INSIG',          'Fundo de previdência de crédito privado gerido pela Icatu Vanguarda. A casa se caracteriza pela gestão conservadora de crédito com longo histórico sem nenhum caso de default e por ter uma equipe experiente. A Vanguarda é focada na gestão, não distribui ou origina qualquer ativo de crédito, e realiza análise própria dos seus investimentos que conta com bureau de análise de crédito próprio atuante há mais de dez anos, que segue parâmetros de avaliação definidos pelo board da Icatu Seguros. A carteira do fundo se caracteriza por ter entre 50% e 80% em ativos de crédito privado de baixo risco e pela gestão ativa de RF na parcela de risco de mercado, porém com baixa volatilidade.',          null,       'S' ,         'S' ,          'S',          'S',          '10000,00'      ,            '800,00'     ,      null          );
insert into TB_INVESTIMENTO (ID,PID_TIPO_INVESTIMENTO,PID_RISCO_PRE_FORMAT,PID_TIPO_RISCO,PID_PRODUTO,PID_EMPRESA,NM_INVESTIMENTO, CD_FUNDO_SEG,DS_RESUMO,FL_MAIOR_VENDA,FL_APORTE_OBRIG,FL_CONTRIB_OBRIG,FL_VISAO_CLIENTE,FL_ATIVO,VL_APORTE, VL_CONTRIBUICAO,COR)values(         591,          1,           null,          null,          6,         4,         'ICATU SEG INSIGNE FIC FI RF CP',          'INSIG',          'Fundo de previdência de crédito privado gerido pela Icatu Vanguarda. A casa se caracteriza pela gestão conservadora de crédito com longo histórico sem nenhum caso de default e por ter uma equipe experiente. A Vanguarda é focada na gestão, não distribui ou origina qualquer ativo de crédito, e realiza análise própria dos seus investimentos que conta com bureau de análise de crédito próprio atuante há mais de dez anos, que segue parâmetros de avaliação definidos pelo board da Icatu Seguros. A carteira do fundo se caracteriza por ter entre 50% e 80% em ativos de crédito privado de baixo risco e pela gestão ativa de RF na parcela de risco de mercado, porém com baixa volatilidade.',          null,       'S' ,         'S' ,          'S',          'S',          '10000,00'      ,            '800,00'     ,      null          );
insert into TB_INVESTIMENTO (ID,PID_TIPO_INVESTIMENTO,PID_RISCO_PRE_FORMAT,PID_TIPO_RISCO,PID_PRODUTO,PID_EMPRESA,NM_INVESTIMENTO, CD_FUNDO_SEG,DS_RESUMO,FL_MAIOR_VENDA,FL_APORTE_OBRIG,FL_CONTRIB_OBRIG,FL_VISAO_CLIENTE,FL_ATIVO,VL_APORTE, VL_CONTRIBUICAO,COR)values(         554,          1,           null,          null,          5,         4,         'SPX LANCER ICATU PREV FIC FIM',          'SPXLA',          'Fundo de previdência multimercado gerido pela SPX Capital, uma das maiores gestoras de recursos independentes do Brasil. O fundo possui um gestor exclusivo dedicado a atividade gestão e atua no mercado de juros e inflação global, moedas, ações e índices de bolsa globais e commodities, considerando as restrições legais de previdência. O objetivo do fundo é a preservação de capital e geração de retorno absoluto no longo prazo. Como diferencial, destaque para a combinação de estratégias domésticas e globais.',          null,       'S' ,         'S' ,          'S',          'S',          '100000,00'      ,            null     ,      null          );
insert into TB_INVESTIMENTO (ID,PID_TIPO_INVESTIMENTO,PID_RISCO_PRE_FORMAT,PID_TIPO_RISCO,PID_PRODUTO,PID_EMPRESA,NM_INVESTIMENTO, CD_FUNDO_SEG,DS_RESUMO,FL_MAIOR_VENDA,FL_APORTE_OBRIG,FL_CONTRIB_OBRIG,FL_VISAO_CLIENTE,FL_ATIVO,VL_APORTE, VL_CONTRIBUICAO,COR)values(         610,          1,           null,          null,          6,         4,         'SPX LANCER ICATU PREV FIC FIM',          'SPXLA',          'Fundo de previdência multimercado gerido pela SPX Capital, uma das maiores gestoras de recursos independentes do Brasil. O fundo possui um gestor exclusivo dedicado a atividade gestão e atua no mercado de juros e inflação global, moedas, ações e índices de bolsa globais e commodities, considerando as restrições legais de previdência. O objetivo do fundo é a preservação de capital e geração de retorno absoluto no longo prazo. Como diferencial, destaque para a combinação de estratégias domésticas e globais.',          null,       'S' ,         'S' ,          'S',          'S',          '100000,00'      ,            null     ,      null          );
insert into TB_INVESTIMENTO (ID,PID_TIPO_INVESTIMENTO,PID_RISCO_PRE_FORMAT,PID_TIPO_RISCO,PID_PRODUTO,PID_EMPRESA,NM_INVESTIMENTO, CD_FUNDO_SEG,DS_RESUMO,FL_MAIOR_VENDA,FL_APORTE_OBRIG,FL_CONTRIB_OBRIG,FL_VISAO_CLIENTE,FL_ATIVO,VL_APORTE, VL_CONTRIBUICAO,COR)values(         23435,          1,           null,          null,          6,         4,         'TRUXT MACRO PREV ICATU FIC FIM',          'TRUXT',          'Fundo de previdência com gestão da Truxt Investimentos. Trata-se de um fundo previdenciário multimercado com estratégia macro que busca replicar a mesma carteira do fundo TRUXT MACRO respeitando as restrições legais da regulação de previdência. A estratégia macro alia a análise fundamentalista, considerando os cenários macroeconômico de médio e longo prazo e identificação de tendências dos ciclos econômicos, com a visão oportunistíca e o monitoramento constante do risco. O fundo tem por objetivo a geração de retorno no longo prazo e a preservação do capital do participante a partir de uma carteira com flexibilidade da alocação de risco total, entre os diversos mercados e estratégias.',          null,       'S' ,         'S' ,          'S',          'S',          '5000,00'      ,            '300,00'     ,      null          );
insert into TB_INVESTIMENTO (ID,PID_TIPO_INVESTIMENTO,PID_RISCO_PRE_FORMAT,PID_TIPO_RISCO,PID_PRODUTO,PID_EMPRESA,NM_INVESTIMENTO, CD_FUNDO_SEG,DS_RESUMO,FL_MAIOR_VENDA,FL_APORTE_OBRIG,FL_CONTRIB_OBRIG,FL_VISAO_CLIENTE,FL_ATIVO,VL_APORTE, VL_CONTRIBUICAO,COR)values(         22990,          1,           null,          null,          5,         4,         'ABSOLUTE ICATU I PREV FIC FIM',          'ABPRE',          'Fundo com gestão da Absolute Investimentos que busca retornos consistentes através de uma filosofia de investimentos não-dogmática que combina: Contraposição do cenário macro com o “técnico” de mercado, reavaliação constante do risco-retorno da operação e política disciplinada de stop-loss. Esse produto tem mesmo estilo de gestão e mesmo horizonte de investimento dos fundos macro CVM 555 da Absolute e atua nos mercados de juros, câmbio e bolsa.',          null,       'S' ,         'S' ,          'S',          'S',          '30000,00'      ,            null     ,      null          );
insert into TB_INVESTIMENTO (ID,PID_TIPO_INVESTIMENTO,PID_RISCO_PRE_FORMAT,PID_TIPO_RISCO,PID_PRODUTO,PID_EMPRESA,NM_INVESTIMENTO, CD_FUNDO_SEG,DS_RESUMO,FL_MAIOR_VENDA,FL_APORTE_OBRIG,FL_CONTRIB_OBRIG,FL_VISAO_CLIENTE,FL_ATIVO,VL_APORTE, VL_CONTRIBUICAO,COR)values(         522,          1,           null,          null,          5,         4,         'ICATU SEG CLASSIC DIVIDENDOS 49 FIC FIM',          'PCC49',          'Fundo de previdência balanceado gerido pela Icatu Vanguarda. O fundo balanceado é um tipo particular de multimercado que investe somente em renda variável e renda fixa em uma proporção definida. O fundo se caracteriza por ter a sua parcela de renda variável buscando superar consistentemente e com menos risco o Ibovespa investindo em ações de empresas que tenham boa gestão e governança, business estável e com previsibilidade de resultados, proteção contra inflação, valuation atrativo com perspectiva de crescimento e que distribuam dividendos, juros sobre capital próprio e outros proventos. Outra característica desses fundos é que a sua parcela de renda fixa adota a estratégia de investimento de inflação curta, que compra títulos públicos e privados indexados à inflação com vencimentos inferiores a 5 anos. Pode aplicar até 49% em renda variável.',          null,       'S' ,         'S' ,          'S',          'S',          '5000,00'      ,            '300,00'     ,      null          );
insert into TB_INVESTIMENTO (ID,PID_TIPO_INVESTIMENTO,PID_RISCO_PRE_FORMAT,PID_TIPO_RISCO,PID_PRODUTO,PID_EMPRESA,NM_INVESTIMENTO, CD_FUNDO_SEG,DS_RESUMO,FL_MAIOR_VENDA,FL_APORTE_OBRIG,FL_CONTRIB_OBRIG,FL_VISAO_CLIENTE,FL_ATIVO,VL_APORTE, VL_CONTRIBUICAO,COR)values(         540,          1,           null,          null,          5,         4,         'ICATU SEG MODERADO E FIC DE FI RF',          'PGE00',          'O fundo compra cotas do fundo ICATU SEG FI RENDA FIXA PREVIDENCIÁRIO (07.376.622/0001-68) que é gerido pela Icatu Vanguarda. O fundo máster compra basicamente títulos pós-fixados e possui exposição a crédito privado e títulos com risco de mercado mais elevada que os fundos conservadores, mas ainda assim apresenta baixa volatilidade.',          null,       'S' ,         'S' ,          'S',          'S',          '1000,00'      ,            '100,00'     ,      null          );
insert into TB_INVESTIMENTO (ID,PID_TIPO_INVESTIMENTO,PID_RISCO_PRE_FORMAT,PID_TIPO_RISCO,PID_PRODUTO,PID_EMPRESA,NM_INVESTIMENTO, CD_FUNDO_SEG,DS_RESUMO,FL_MAIOR_VENDA,FL_APORTE_OBRIG,FL_CONTRIB_OBRIG,FL_VISAO_CLIENTE,FL_ATIVO,VL_APORTE, VL_CONTRIBUICAO,COR)values(         562,          1,           null,          null,          6,         4,         'ARX INCOME ICATU PREV FIM',          'NW3',          'Fundo de previdência multimercado gerido pela Arx Investimentos. O fundo Arx Income Icatu Prev FIM  investe basicamente em títulos públicos indexados à inflação com vencimento inferior a 5 anos e renda variável através da estratégia value. A filosofia de investimentos dessa estratégia é baseada na preservação do capital e geração de renda por meio do investimento em empresas que apresentem uma alta relação entre dividendo (presente ou futura) e preço e sólidos fundamentos de valor (valuation).',          null,       'S' ,         'S' ,          'S',          'S',          '5000,00'      ,            '300,00'     ,      null          );
insert into TB_INVESTIMENTO (ID,PID_TIPO_INVESTIMENTO,PID_RISCO_PRE_FORMAT,PID_TIPO_RISCO,PID_PRODUTO,PID_EMPRESA,NM_INVESTIMENTO, CD_FUNDO_SEG,DS_RESUMO,FL_MAIOR_VENDA,FL_APORTE_OBRIG,FL_CONTRIB_OBRIG,FL_VISAO_CLIENTE,FL_ATIVO,VL_APORTE, VL_CONTRIBUICAO,COR)values(         521,          1,           null,          null,          5,         4,         'ICATU SEG CLASSIC DIVIDENDOS 20 FIC FIM',          'SBC20',          'Fundo de previdência balanceado gerido pela Icatu Vanguarda. O fundo balanceado é um tipo particular de multimercado que investe somente em renda variável e renda fixa em uma proporção definida. O fundo se caracteriza por ter a sua parcela de renda variável buscando superar consistentemente e com menos risco o Ibovespa investindo em ações de empresas que tenham boa gestão e governança, business estável e com previsibilidade de resultados, proteção contra inflação, valuation atrativo com perspectiva de crescimento e que distribuam dividendos, juros sobre capital próprio e outros proventos. Outra característica desses fundos é que a sua parcela de renda fixa adota a estratégia de investimento de inflação curta, que compra títulos públicos e privados indexados à inflação com vencimentos inferiores a 5 anos. Pode aplicar até 20% em renda variável.',          null,       'S' ,         'S' ,          'S',          'S',          '5000,00'      ,            '300,00'     ,      null          );
insert into TB_INVESTIMENTO (ID,PID_TIPO_INVESTIMENTO,PID_RISCO_PRE_FORMAT,PID_TIPO_RISCO,PID_PRODUTO,PID_EMPRESA,NM_INVESTIMENTO, CD_FUNDO_SEG,DS_RESUMO,FL_MAIOR_VENDA,FL_APORTE_OBRIG,FL_CONTRIB_OBRIG,FL_VISAO_CLIENTE,FL_ATIVO,VL_APORTE, VL_CONTRIBUICAO,COR)values(         587,          1,           null,          null,          6,         4,         'ICATU SEG FIC FI RF INFLAÇÃO LONGA',          'NW6',          'É um fundo que compra basicamente títulos públicos e privados indexados à inflação com vencimentos superiores a 5 anos. A carteira do fundo busca replicar a composição do IMA-B 5+ tendo duration e yield próximos ao índice. Apresenta volatilidade elevada apesar de ser de renda fixa. Essa característica deve-se a necessidade de marcar a mercado os títulos que compõem a carteira do fundo, isto é, os papéis devem ter o seu valor de venda atualizados diariamente mesmo que sejam carregados até o vencimento. As NTN-Bs por possuírem um caráter pré-fixado apresentam variação no seu valor de mercado conforme alterações nas expectativas de juros futuras, de maneira geral, se há expectativa de subida nas taxas de juros os preços dos títulos caem e se há expectativa de queda nas taxas de juros os preços sobem.',          null,       'S' ,         'S' ,          'S',          'S',          '1000,00'      ,            '100,00'     ,      null          );
insert into TB_INVESTIMENTO (ID,PID_TIPO_INVESTIMENTO,PID_RISCO_PRE_FORMAT,PID_TIPO_RISCO,PID_PRODUTO,PID_EMPRESA,NM_INVESTIMENTO, CD_FUNDO_SEG,DS_RESUMO,FL_MAIOR_VENDA,FL_APORTE_OBRIG,FL_CONTRIB_OBRIG,FL_VISAO_CLIENTE,FL_ATIVO,VL_APORTE, VL_CONTRIBUICAO,COR)values(         534,          1,           null,          null,          5,         4,         'ICATU SEG INFLAÇÃO FI RF',          'PGIGP',          'É um fundo que compra basicamente títulos públicos e privados indexados à inflação. O fundo busca ter exposição tanto a IGP-M quanto IPCA. Apresenta volatilidade elevada apesar de ser de renda fixa. Essa característica deve-se a necessidade de marcar a mercado os títulos que compõem a carteira do fundo, isto é, os papéis devem ter o seu valor de venda atualizados diariamente mesmo que sejam carregados até o vencimento. As NTN-Bs por possuírem um caráter pré-fixado apresentam variação no seu preço unitário conforme alterações nas expectativas de juros futuras, de maneira geral, se há expectativa de subida nas taxas de juros os preços dos títulos caem e se há expectativa de queda nas taxas de juros os preços sobem.',          null,       'S' ,         'S' ,          'S',          'S',          '1000,00'      ,            '100,00'     ,      null          );
insert into TB_INVESTIMENTO (ID,PID_TIPO_INVESTIMENTO,PID_RISCO_PRE_FORMAT,PID_TIPO_RISCO,PID_PRODUTO,PID_EMPRESA,NM_INVESTIMENTO, CD_FUNDO_SEG,DS_RESUMO,FL_MAIOR_VENDA,FL_APORTE_OBRIG,FL_CONTRIB_OBRIG,FL_VISAO_CLIENTE,FL_ATIVO,VL_APORTE, VL_CONTRIBUICAO,COR)values(         581,          1,           null,          null,          6,         4,         'ICATU SEG COMPOSTO 49E FIC FIM',          'PGE49',          'Fundo de previdência balanceado gerido pela Icatu Vanguarda. O fundo balanceado é um tipo particular de multimercado que investe somente em renda variável e renda fixa em uma proporção definida. O fundo se caracteriza por ter uma parcela de renda variável que busca replicar a rentabilidade do Ibovespa e ter uma parcela de renda fixa com gestão ativa. Pode aplicar até 49% em renda variável.',          null,       'S' ,         'S' ,          'S',          'S',          '1000,00'      ,            '100,00'     ,      null          );
insert into TB_INVESTIMENTO (ID,PID_TIPO_INVESTIMENTO,PID_RISCO_PRE_FORMAT,PID_TIPO_RISCO,PID_PRODUTO,PID_EMPRESA,NM_INVESTIMENTO, CD_FUNDO_SEG,DS_RESUMO,FL_MAIOR_VENDA,FL_APORTE_OBRIG,FL_CONTRIB_OBRIG,FL_VISAO_CLIENTE,FL_ATIVO,VL_APORTE, VL_CONTRIBUICAO,COR)values(         537,          1,           null,          null,          5,         4,         'IS MINHA APOSENTADORIA 2020 FIC FIM',          'MAP02',          'Fundo data-alvo gerido pela Icatu Vanguarda. O fundo tenta replicar o ciclo de vida de um cliente que se torna mais conservador a medida que se aproxima da sua data aposentadoria, da mesma forma, o fundo vai diminuindo a sua volatilidade conforme se aproxima da data-alvo. A estratégia é dinâmica e não há necessidade, por parte do cliente, de readequar a sua carteira por grau de risco ou fazer revisões periódicas.',          null,       'S' ,         'S' ,          'S',          'S',          '1000,00'      ,            '100,00'     ,      null          );
insert into TB_INVESTIMENTO (ID,PID_TIPO_INVESTIMENTO,PID_RISCO_PRE_FORMAT,PID_TIPO_RISCO,PID_PRODUTO,PID_EMPRESA,NM_INVESTIMENTO, CD_FUNDO_SEG,DS_RESUMO,FL_MAIOR_VENDA,FL_APORTE_OBRIG,FL_CONTRIB_OBRIG,FL_VISAO_CLIENTE,FL_ATIVO,VL_APORTE, VL_CONTRIBUICAO,COR)values(         526,          1,           null,          null,          5,         4,         'SANTANDER ICATU LARK I CP FIC FIE RF',          'DYNAM',          'Fundo de renda fixa com gestão da Santander Asset. O fundo busca elevados retornos a partir de uma gestão ativa em renda fixa investindo nos mercados locais e offshore de juros e crédito. A volatilidade do fundo é de baixa a moderada, podendo aumentar a exposição a risco de mercado em momentos oportunos.',          null,       'S' ,         'S' ,          'S',          'S',          '30000,00'      ,            null     ,      null          );
insert into TB_INVESTIMENTO (ID,PID_TIPO_INVESTIMENTO,PID_RISCO_PRE_FORMAT,PID_TIPO_RISCO,PID_PRODUTO,PID_EMPRESA,NM_INVESTIMENTO, CD_FUNDO_SEG,DS_RESUMO,FL_MAIOR_VENDA,FL_APORTE_OBRIG,FL_CONTRIB_OBRIG,FL_VISAO_CLIENTE,FL_ATIVO,VL_APORTE, VL_CONTRIBUICAO,COR)values(         592,          1,           null,          null,          6,         4,         'ICATU SEG KADIMA FIM CP PREVIDÊNCIA',          'KADIM',          'É o único fundo de previdência quantitativo do Brasil, a gestão fica a cargo da Kadima Asset Management. O gestor utiliza algoritmos computacionais para auxiliar na composição da carteira do fundo, esses algoritmos tentam identificar tendências de curto e médio prazo e arbitrar em cima de ineficiências de mercado. A estratégia possui baixa correlação com a maioria das estratégias oferecidas em fundos de previdência sendo um bom veículo de diversificação da carteira.',          null,       'S' ,         'S' ,          'S',          'S',          '5000,00'      ,            '300,00'     ,      null          );
insert into TB_INVESTIMENTO (ID,PID_TIPO_INVESTIMENTO,PID_RISCO_PRE_FORMAT,PID_TIPO_RISCO,PID_PRODUTO,PID_EMPRESA,NM_INVESTIMENTO, CD_FUNDO_SEG,DS_RESUMO,FL_MAIOR_VENDA,FL_APORTE_OBRIG,FL_CONTRIB_OBRIG,FL_VISAO_CLIENTE,FL_ATIVO,VL_APORTE, VL_CONTRIBUICAO,COR)values(         549,          1,           null,          null,          5,         4,         'SANTANDER ICATU STRIX FI ESP CONST MULT',          'MRATE',          'Fundo de previdência multimercado gerido pelo Santader Asset. O SANTANDER ICATU STRIX FIE MM é um fundo multimercado com baixa volatilidade que investe em juros e moedas.',          null,       'S' ,         'S' ,          'S',          'S',          '5000,00'      ,            '300,00'     ,      null          );
insert into TB_INVESTIMENTO (ID,PID_TIPO_INVESTIMENTO,PID_RISCO_PRE_FORMAT,PID_TIPO_RISCO,PID_PRODUTO,PID_EMPRESA,NM_INVESTIMENTO, CD_FUNDO_SEG,DS_RESUMO,FL_MAIOR_VENDA,FL_APORTE_OBRIG,FL_CONTRIB_OBRIG,FL_VISAO_CLIENTE,FL_ATIVO,VL_APORTE, VL_CONTRIBUICAO,COR)values(         564,          1,           null,          null,          6,         4,         'AZ QUEST ICATU MULTIPREV ARROJADO FIM',          'NEST',          'O AZ QUEST ICATU MULTI PREV FIC FIM é um fundo de previdência multimercado, gerido pela AZ Quest, desenvolvido para investidores pessoas físicas interessadas em constituir reservas de aposentadoria e/ou investimento de longo prazo, através da gestão ativa de uma carteira composta por ativos líquidos nos mercados de juros, moedas e ações.',          null,       'S' ,         'S' ,          'S',          'S',          '5000,00'      ,            '300,00'     ,      null          );
insert into TB_INVESTIMENTO (ID,PID_TIPO_INVESTIMENTO,PID_RISCO_PRE_FORMAT,PID_TIPO_RISCO,PID_PRODUTO,PID_EMPRESA,NM_INVESTIMENTO, CD_FUNDO_SEG,DS_RESUMO,FL_MAIOR_VENDA,FL_APORTE_OBRIG,FL_CONTRIB_OBRIG,FL_VISAO_CLIENTE,FL_ATIVO,VL_APORTE, VL_CONTRIBUICAO,COR)values(         518,          1,           null,          null,          5,         4,         'ICATU SEG ABSOLUTO FI PREV RF CP',          'ABSOL',          'Fundo de previdência de crédito privado gerido pela Icatu Vanguarda. A casa se caracteriza pela gestão conservadora de crédito com longo histórico sem nenhum caso de default e por ter uma equipe experiente. A Vanguarda é focada na gestão, não distribui ou origina qualquer ativo de crédito, e realiza análise própria dos seus investimentos que conta com bureau de análise de crédito próprio atuante há mais de dez anos, que segue parâmetros de avaliação definidos pelo board da Icatu Seguros. É um fundo de crédito de volatilidade baixíssima.',          null,       'S' ,         'S' ,          'S',          'S',          '10000,00'      ,            '800,00'     ,      null          );
insert into TB_INVESTIMENTO (ID,PID_TIPO_INVESTIMENTO,PID_RISCO_PRE_FORMAT,PID_TIPO_RISCO,PID_PRODUTO,PID_EMPRESA,NM_INVESTIMENTO, CD_FUNDO_SEG,DS_RESUMO,FL_MAIOR_VENDA,FL_APORTE_OBRIG,FL_CONTRIB_OBRIG,FL_VISAO_CLIENTE,FL_ATIVO,VL_APORTE, VL_CONTRIBUICAO,COR)values(         588,          1,           null,          null,          6,         4,         'ICATU SEG FRANKLIN TEMPLETON PREV FIM',          'FRANK',          'Fundo de previdência multimercado gerido pela Franklin Templeton Investimentos. O fundo tem por objetivo buscar a valorização dos capitais investidos no longo prazo, mediante a utilização de estratégia de investimento diversificada, que envolve vários fatores de risco, sem o compromisso de concentração em nenhum ativo ou fator de risco em especial e com utilização de operações em mercado de derivativos, sem alavancagem, com o objetivo de superar o CDI. É importante destacar que o fundo não tem posições em renda variável, é um fundo basicamente de juros e moedas.',          null,       'S' ,         'S' ,          'S',          'S',          '5000,00'      ,            '300,00'     ,      null          );
insert into TB_INVESTIMENTO (ID,PID_TIPO_INVESTIMENTO,PID_RISCO_PRE_FORMAT,PID_TIPO_RISCO,PID_PRODUTO,PID_EMPRESA,NM_INVESTIMENTO, CD_FUNDO_SEG,DS_RESUMO,FL_MAIOR_VENDA,FL_APORTE_OBRIG,FL_CONTRIB_OBRIG,FL_VISAO_CLIENTE,FL_ATIVO,VL_APORTE, VL_CONTRIBUICAO,COR)values(         511,          1,           null,          null,          5,         4,         'BRASIL PLURAL CC ICATU PREV CP FIC FI RF',          'PLUCP',          'Fundo de previdência de crédito privado gerido pela Brasil Plural. A gestora se caracteriza por ter equipe de crédito dedicada e multidisciplinar, concentração em menor quantidade de empresas com vantagens comparativas, gestão ativa e por fazer análise multivetorial que incluem atribuição de rating próprio, análises de liquidez, setoriais e macroeconômicas.',          null,       'S' ,         'S' ,          'S',          'S',          '30000,00'      ,            null     ,      null          );
insert into TB_INVESTIMENTO (ID,PID_TIPO_INVESTIMENTO,PID_RISCO_PRE_FORMAT,PID_TIPO_RISCO,PID_PRODUTO,PID_EMPRESA,NM_INVESTIMENTO, CD_FUNDO_SEG,DS_RESUMO,FL_MAIOR_VENDA,FL_APORTE_OBRIG,FL_CONTRIB_OBRIG,FL_VISAO_CLIENTE,FL_ATIVO,VL_APORTE, VL_CONTRIBUICAO,COR)values(         509,          1,           null,          null,          5,         4,         'AZ QUEST PREV ICT CONSERVADOR FICFIRFCP',          'AZQRF',          'O fundo busca a geração de retornos superiores e preservação de capital do investidor, através de rigoroso processo de análise fundamentalista e gestão ativa do portfólio de crédito privado. O portfólio do fundo é composto majoritariamente de títulos de emissões bancárias e debentures de baixo risco de crédito privado.',          null,       'S' ,         'S' ,          'S',          'S',          '30000,00'      ,            null     ,      null          );
insert into TB_INVESTIMENTO (ID,PID_TIPO_INVESTIMENTO,PID_RISCO_PRE_FORMAT,PID_TIPO_RISCO,PID_PRODUTO,PID_EMPRESA,NM_INVESTIMENTO, CD_FUNDO_SEG,DS_RESUMO,FL_MAIOR_VENDA,FL_APORTE_OBRIG,FL_CONTRIB_OBRIG,FL_VISAO_CLIENTE,FL_ATIVO,VL_APORTE, VL_CONTRIBUICAO,COR)values(         551,          1,           null,          null,          5,         4,         'VINCI EQUILÍBRIO ICATU PREV FIC FIM II',          'VIN2',          'Fundo multimercado gerido pela Vinci. O fundo aloca recursos nas seguintes estratégias: renda fixa – pós-fixado, renda fixa – inflação curta e renda variável – dividendos. A gestora possui bom histórico na estratégia de dividendos cujo objetivo é realizar investimentos em empresas de bons retornos de longo prazo e com baixa volatilidade. Tais empresas, em geral, são maduras, com baixo risco de negócio, baixo risco de projeção, geram lucros e têm baixa necessidade de re-investimento. Além disso, possuem sustentável geração de caixa e de distribuição de resultados e também possuem boa proteção contra inflação.',          null,       'S' ,         'S' ,          'S',          'S',          '5000,00'      ,            '300,00'     ,      null          );
insert into TB_INVESTIMENTO (ID,PID_TIPO_INVESTIMENTO,PID_RISCO_PRE_FORMAT,PID_TIPO_RISCO,PID_PRODUTO,PID_EMPRESA,NM_INVESTIMENTO, CD_FUNDO_SEG,DS_RESUMO,FL_MAIOR_VENDA,FL_APORTE_OBRIG,FL_CONTRIB_OBRIG,FL_VISAO_CLIENTE,FL_ATIVO,VL_APORTE, VL_CONTRIBUICAO,COR)values(         569,          1,           null,          null,          6,         4,         'CANVAS ICATU PREV FIC FI MULT PREV',          'CANVA',          'O objetivo do fundo CANVAS ICATU PREVIDÊNCIA FIC FI MULT PREV é preservação de capital com geração de retorno absoluto no longo prazo. Os investimentos são feitos apenas em mercados líquidos, com foco na estratégia multimercado macro e uso seletivo de crédito. A equipe da Canvas Capital tem um histórico de 10 anos com forte geração de ganhos em diversos mercados, dentro de um processo de investimento disciplinado e de uma plataforma robusta de governança corporativa e compliance.',          null,       'S' ,         'S' ,          'S',          'S',          '5000,00'      ,            '300,00'     ,      null          );
insert into TB_INVESTIMENTO (ID,PID_TIPO_INVESTIMENTO,PID_RISCO_PRE_FORMAT,PID_TIPO_RISCO,PID_PRODUTO,PID_EMPRESA,NM_INVESTIMENTO, CD_FUNDO_SEG,DS_RESUMO,FL_MAIOR_VENDA,FL_APORTE_OBRIG,FL_CONTRIB_OBRIG,FL_VISAO_CLIENTE,FL_ATIVO,VL_APORTE, VL_CONTRIBUICAO,COR)values(         603,          1,           null,          null,          6,         4,         'NAVI LONG SHORT ICATU PREV FIM',          'KONDO',          'O fundo adota uma estratégia Long Short, que consiste em uma operação casada, na qual se mantêm uma posição vendida em uma ação e comprada em outra no intuito de obter um residual financeiro da operação quando liquidá-la.',          null,       'S' ,         'S' ,          'S',          'N',          '5000,00'      ,            '300,00'     ,      null          );
insert into TB_INVESTIMENTO (ID,PID_TIPO_INVESTIMENTO,PID_RISCO_PRE_FORMAT,PID_TIPO_RISCO,PID_PRODUTO,PID_EMPRESA,NM_INVESTIMENTO, CD_FUNDO_SEG,DS_RESUMO,FL_MAIOR_VENDA,FL_APORTE_OBRIG,FL_CONTRIB_OBRIG,FL_VISAO_CLIENTE,FL_ATIVO,VL_APORTE, VL_CONTRIBUICAO,COR)values(         23429,          1,           null,          null,          6,         4,         'ICATU SEG MACRO FIM PREV',          'MACRO',          'O fundo Icatu Seg Macro Prev é um fundo multimercado que terá gestão compartilhada entre as equipes de multiestratégia e de renda variável da Icatu Vanguarda. As decisões de investimento do fundo são tomadas em conjunto pelos gestores/traders responsáveis por cada uma das áreas a partir de análise macro fundamentada em modelos próprios. O objetivo do fundo é oferecer retornos consistentes no longo prazo e a preservação do capital contando com um portfólio diversificado e com elevada liquidez. O fundo fará operações em diversos mercados incluindo os mercados de renda fixa, renda variável e câmbio. Operações Shorts e DayTrade são permitidas.',          null,       'S' ,         'S' ,          'S',          'S',          '5000,00'      ,            '300,00'     ,      null          );
insert into TB_INVESTIMENTO (ID,PID_TIPO_INVESTIMENTO,PID_RISCO_PRE_FORMAT,PID_TIPO_RISCO,PID_PRODUTO,PID_EMPRESA,NM_INVESTIMENTO, CD_FUNDO_SEG,DS_RESUMO,FL_MAIOR_VENDA,FL_APORTE_OBRIG,FL_CONTRIB_OBRIG,FL_VISAO_CLIENTE,FL_ATIVO,VL_APORTE, VL_CONTRIBUICAO,COR)values(         552,          1,           null,          null,          5,         4,         'BOGARI VALUE ICATU PREV FIM',          'BOGAR',          'O BOGARI VALUE ICATU PREV FIM é um fundo de previdência multimercado gerido pela Bogari Capital que busca ter 70% de seu Patrimônio Líquido alocado em renda variável e o restante (30%) em renda fixa. O seu grande diferencial é a parcela de renda variável que busca replicar a mesma carteira do fundo aberto da gestora, cujo objetivo é prover aos clientes retornos consistentes no longo prazo através de investimento em ativos de elevado potencial de valorização. Investe em ações de empresas que estão sendo negociadas substancialmente abaixo de seu valor intrínseco.',          null,       'S' ,         'S' ,          'S',          'S',          '5000,00'      ,            '300,00'     ,      null          );
insert into TB_INVESTIMENTO (ID,PID_TIPO_INVESTIMENTO,PID_RISCO_PRE_FORMAT,PID_TIPO_RISCO,PID_PRODUTO,PID_EMPRESA,NM_INVESTIMENTO, CD_FUNDO_SEG,DS_RESUMO,FL_MAIOR_VENDA,FL_APORTE_OBRIG,FL_CONTRIB_OBRIG,FL_VISAO_CLIENTE,FL_ATIVO,VL_APORTE, VL_CONTRIBUICAO,COR)values(         624,          1,           null,          null,          5,         4,         'GARDE ICATU PREV FIC FIM',          'GARDE',          'O fundo GARDE ICATU PREV é gerido pela Garde Asset Management que busca seguir as mesmas estratégias dos fundos multimercados da gestora, respeitando as restrições legais. Destinado a clientes que buscam performance diferenciada e conta com um Sócio-Gestor exclusivamente dedicado ao produto de previdência, criando um produto sofisticado e descorrelacionado com os demais fundos tradicionais de previdência.',          null,       'S' ,         'S' ,          'S',          'S',          '5000,00'      ,            '300,00'     ,      null          );
insert into TB_INVESTIMENTO (ID,PID_TIPO_INVESTIMENTO,PID_RISCO_PRE_FORMAT,PID_TIPO_RISCO,PID_PRODUTO,PID_EMPRESA,NM_INVESTIMENTO, CD_FUNDO_SEG,DS_RESUMO,FL_MAIOR_VENDA,FL_APORTE_OBRIG,FL_CONTRIB_OBRIG,FL_VISAO_CLIENTE,FL_ATIVO,VL_APORTE, VL_CONTRIBUICAO,COR)values(         578,          1,           null,          null,          6,         4,         'ICATU SEG CLASSIC DIVIDENDOS 49 FIC FIM',          'PCC49',          'Fundo de previdência balanceado gerido pela Icatu Vanguarda. O fundo balanceado é um tipo particular de multimercado que investe somente em renda variável e renda fixa em uma proporção definida. O fundo se caracteriza por ter a sua parcela de renda variável buscando superar consistentemente e com menos risco o Ibovespa investindo em ações de empresas que tenham boa gestão e governança, business estável e com previsibilidade de resultados, proteção contra inflação, valuation atrativo com perspectiva de crescimento e que distribuam dividendos, juros sobre capital próprio e outros proventos. Outra característica desses fundos é que a sua parcela de renda fixa adota a estratégia de investimento de inflação curta, que compra títulos públicos e privados indexados à inflação com vencimentos inferiores a 5 anos. Pode aplicar até 49% em renda variável.',          null,       'S' ,         'S' ,          'S',          'S',          '5000,00'      ,            '300,00'     ,      null          );
insert into TB_INVESTIMENTO (ID,PID_TIPO_INVESTIMENTO,PID_RISCO_PRE_FORMAT,PID_TIPO_RISCO,PID_PRODUTO,PID_EMPRESA,NM_INVESTIMENTO, CD_FUNDO_SEG,DS_RESUMO,FL_MAIOR_VENDA,FL_APORTE_OBRIG,FL_CONTRIB_OBRIG,FL_VISAO_CLIENTE,FL_ATIVO,VL_APORTE, VL_CONTRIBUICAO,COR)values(         506,          1,           null,          null,          5,         4,         'ARX INCOME ICATU PREV FIM',          'NW3',          'Fundo de previdência multimercado gerido pela Arx Investimentos. O fundo Arx Income Icatu Prev FIM  investe basicamente em títulos públicos indexados à inflação com vencimento inferior a 5 anos e renda variável através da estratégia value. A filosofia de investimentos dessa estratégia é baseada na preservação do capital e geração de renda por meio do investimento em empresas que apresentem uma alta relação entre dividendo (presente ou futura) e preço e sólidos fundamentos de valor (valuation).',          null,       'S' ,         'S' ,          'S',          'S',          '5000,00'      ,            '300,00'     ,      null          );
insert into TB_INVESTIMENTO (ID,PID_TIPO_INVESTIMENTO,PID_RISCO_PRE_FORMAT,PID_TIPO_RISCO,PID_PRODUTO,PID_EMPRESA,NM_INVESTIMENTO, CD_FUNDO_SEG,DS_RESUMO,FL_MAIOR_VENDA,FL_APORTE_OBRIG,FL_CONTRIB_OBRIG,FL_VISAO_CLIENTE,FL_ATIVO,VL_APORTE, VL_CONTRIBUICAO,COR)values(         577,          1,           null,          null,          6,         4,         'ICATU SEG CLASSIC DIVIDENDOS 20 FIC FIM',          'SBC20',          'Fundo de previdência balanceado gerido pela Icatu Vanguarda. O fundo balanceado é um tipo particular de multimercado que investe somente em renda variável e renda fixa em uma proporção definida. O fundo se caracteriza por ter a sua parcela de renda variável buscando superar consistentemente e com menos risco o Ibovespa investindo em ações de empresas que tenham boa gestão e governança, business estável e com previsibilidade de resultados, proteção contra inflação, valuation atrativo com perspectiva de crescimento e que distribuam dividendos, juros sobre capital próprio e outros proventos. Outra característica desses fundos é que a sua parcela de renda fixa adota a estratégia de investimento de inflação curta, que compra títulos públicos e privados indexados à inflação com vencimentos inferiores a 5 anos. Pode aplicar até 20% em renda variável.',          null,       'S' ,         'S' ,          'S',          'S',          '5000,00'      ,            '300,00'     ,      null          );
insert into TB_INVESTIMENTO (ID,PID_TIPO_INVESTIMENTO,PID_RISCO_PRE_FORMAT,PID_TIPO_RISCO,PID_PRODUTO,PID_EMPRESA,NM_INVESTIMENTO, CD_FUNDO_SEG,DS_RESUMO,FL_MAIOR_VENDA,FL_APORTE_OBRIG,FL_CONTRIB_OBRIG,FL_VISAO_CLIENTE,FL_ATIVO,VL_APORTE, VL_CONTRIBUICAO,COR)values(         531,          1,           null,          null,          5,         4,         'ICATU SEG FIC FI RF INFLAÇÃO LONGA',          'NW6',          'É um fundo que compra basicamente títulos públicos e privados indexados à inflação com vencimentos superiores a 5 anos. A carteira do fundo busca replicar a composição do IMA-B 5+ tendo duration e yield próximos ao índice. Apresenta volatilidade elevada apesar de ser de renda fixa. Essa característica deve-se a necessidade de marcar a mercado os títulos que compõem a carteira do fundo, isto é, os papéis devem ter o seu valor de venda atualizados diariamente mesmo que sejam carregados até o vencimento. As NTN-Bs por possuírem um caráter pré-fixado apresentam variação no seu valor de mercado conforme alterações nas expectativas de juros futuras, de maneira geral, se há expectativa de subida nas taxas de juros os preços dos títulos caem e se há expectativa de queda nas taxas de juros os preços sobem.',          null,       'S' ,         'S' ,          'S',          'S',          '1000,00'      ,            '100,00'     ,      null          );
insert into TB_INVESTIMENTO (ID,PID_TIPO_INVESTIMENTO,PID_RISCO_PRE_FORMAT,PID_TIPO_RISCO,PID_PRODUTO,PID_EMPRESA,NM_INVESTIMENTO, CD_FUNDO_SEG,DS_RESUMO,FL_MAIOR_VENDA,FL_APORTE_OBRIG,FL_CONTRIB_OBRIG,FL_VISAO_CLIENTE,FL_ATIVO,VL_APORTE, VL_CONTRIBUICAO,COR)values(         523,          1,           null,          null,          5,         4,         'ICATU SEG CLASSIC FIC FI RF',          'PGIHC',          'Esse fundo compra cotas do fundo ICATU SEG FI RENDA FIXA PREVIDENCIÁRIO (07.376.622/0001-68) que é gerido pela Icatu Vanguarda. O fundo máster compra basicamente títulos pós-fixados e possui exposição a crédito privado e títulos com risco de mercado mais elevada que os fundos conservadores, mas ainda assim apresenta baixa volatilidade.',          null,       'S' ,         'S' ,          'S',          'S',          '5000,00'      ,            '300,00'     ,      null          );
insert into TB_INVESTIMENTO (ID,PID_TIPO_INVESTIMENTO,PID_RISCO_PRE_FORMAT,PID_TIPO_RISCO,PID_PRODUTO,PID_EMPRESA,NM_INVESTIMENTO, CD_FUNDO_SEG,DS_RESUMO,FL_MAIOR_VENDA,FL_APORTE_OBRIG,FL_CONTRIB_OBRIG,FL_VISAO_CLIENTE,FL_ATIVO,VL_APORTE, VL_CONTRIBUICAO,COR)values(         583,          1,           null,          null,          6,         4,         'SANTANDER ICATU LARK II CP FIC FIE RF',          'DYNII',          'Fundo de renda fixa com gestão da Santander Asset. O fundo busca elevados retornos a partir de uma gestão ativa em renda fixa investindo nos mercados locais e offshore de juros e crédito. A volatilidade do fundo é de baixa a moderada, podendo aumentar a exposição a risco de mercado em momentos oportunos.',          null,       'S' ,         'S' ,          'S',          'S',          '30000,00'      ,            null     ,      null          );
insert into TB_INVESTIMENTO (ID,PID_TIPO_INVESTIMENTO,PID_RISCO_PRE_FORMAT,PID_TIPO_RISCO,PID_PRODUTO,PID_EMPRESA,NM_INVESTIMENTO, CD_FUNDO_SEG,DS_RESUMO,FL_MAIOR_VENDA,FL_APORTE_OBRIG,FL_CONTRIB_OBRIG,FL_VISAO_CLIENTE,FL_ATIVO,VL_APORTE, VL_CONTRIBUICAO,COR)values(         517,          1,           null,          null,          5,         4,         'IBIUNA PREV ICATU FIC FIM',          'IBIUN',          'A Ibiuna Investimentos foi fundada em maio de 2010, com o objetivo de gerar retornos ao longo de longo prazo aos seus clientes. Possui sólida equipe de profissionais seniores, com larga experiência nos mercados local e internacional, liderada por Mário Torós, Rodrigo Azevedo e André Lion. O IBIUNA PREV ICATU FIC FIM é um fundo de previdência multimercado com enfoque macro “top down” que objetiva proporcionar aos seus cotistas ganhos de capital no longo prazo. O fundo busca oportunidades nos mercados de juros, moedas e renda variável. Foi um dos primeiros fundos de previdência multimercado, o fundo existe desde 2013.',          null,       'S' ,         'S' ,          'S',          'S',          '5000,00'      ,            '300,00'     ,      null          );
insert into TB_INVESTIMENTO (ID,PID_TIPO_INVESTIMENTO,PID_RISCO_PRE_FORMAT,PID_TIPO_RISCO,PID_PRODUTO,PID_EMPRESA,NM_INVESTIMENTO, CD_FUNDO_SEG,DS_RESUMO,FL_MAIOR_VENDA,FL_APORTE_OBRIG,FL_CONTRIB_OBRIG,FL_VISAO_CLIENTE,FL_ATIVO,VL_APORTE, VL_CONTRIBUICAO,COR)values(         550,          1,           null,          null,          5,         4,         'VERDE AM ICATU PREVIDÊNCIA FIC FIM PREV',          'VERDE',          'Fundo de previdência multimercado gerido pela Verde AM. A Verde Asset conta com a liderança do renomado Luis Stuhlberger e possui R$ 33 bilhões (PL aproximado em ago/2017) sob gestão sendo uma das maiores gestoras independentes do mercado. A filosofia de investimento da casa baseia-se em estudo e trabalho intenso de pesquisa e em um processo profundo de análises macro e microeconômicas com viés fundamentalista, contemplando o mercado local e internacional. O VERDE AM ICATU PREV FIC FIM PREV investe principalmente em renda variável local e global, câmbio e renda fixa.',          null,       'S' ,         'S' ,          'S',          'S',          '5000,00'      ,            '300,00'     ,      null          );
insert into TB_INVESTIMENTO (ID,PID_TIPO_INVESTIMENTO,PID_RISCO_PRE_FORMAT,PID_TIPO_RISCO,PID_PRODUTO,PID_EMPRESA,NM_INVESTIMENTO, CD_FUNDO_SEG,DS_RESUMO,FL_MAIOR_VENDA,FL_APORTE_OBRIG,FL_CONTRIB_OBRIG,FL_VISAO_CLIENTE,FL_ATIVO,VL_APORTE, VL_CONTRIBUICAO,COR)values(         613,          1,           null,          null,          6,         4,         'WESTERN ASSET ICATU RF ATIVO PREV FIC FI',          'WEPRE',          'Fundo de renda fixa com gestão da Western Asset. O fundo tem por objetivo proporcionar rentabilidade através das oportunidades oferecidas pelos mercados domésticos de taxa de juros pré-fixadas, taxas de juros de um dia praticadas no mercado interbancário e índices de preço, excluindo estratégias que impliquem risco de moeda estrangeira ou de renda variável. Para a realização do objetivo do Fundo, o gestor buscará primordialmente aumentar ou diminuir, conforme o caso, a exposição do Fundo ao mercado de taxas de juros, procurando, conforme o caso, obter ganhos adicionais ou limitar perdas para a carteira.',          null,       'S' ,         'S' ,          'S',          'S',          '30000,00'      ,            null     ,      null          );
insert into TB_INVESTIMENTO (ID,PID_TIPO_INVESTIMENTO,PID_RISCO_PRE_FORMAT,PID_TIPO_RISCO,PID_PRODUTO,PID_EMPRESA,NM_INVESTIMENTO, CD_FUNDO_SEG,DS_RESUMO,FL_MAIOR_VENDA,FL_APORTE_OBRIG,FL_CONTRIB_OBRIG,FL_VISAO_CLIENTE,FL_ATIVO,VL_APORTE, VL_CONTRIBUICAO,COR)values(         507,          1,           null,          null,          5,         4,         'ATHENA ICATU PREV FIM 49',          'ATENA',          'Fundo de previdência multimercado gerido pela Athena Capital. O fundo investe basicamente em títulos públicos de baixo risco e renda variável. A parcela de renda variável adota como filosofia de investimento uma análise fundamentalista, amparada majoritariamente por análises e observações feitas diretamente na economia real. O fundo possui por objetivo proporcionar ganhos absolutos e consistentes a médio e longo prazo, sem perseguir correlação com qualquer índice de Bolsa. A parcela de renda variável do fundo fica predominantemente comprada em ações, mas pode, eventualmente, ter posições vendidas para ganho absoluto. Pode alocar até 49% de seu PL em renda variável.',          null,       'S' ,         'S' ,          'S',          'S',          '5000,00'      ,            '300,00'     ,      null          );
insert into TB_INVESTIMENTO (ID,PID_TIPO_INVESTIMENTO,PID_RISCO_PRE_FORMAT,PID_TIPO_RISCO,PID_PRODUTO,PID_EMPRESA,NM_INVESTIMENTO, CD_FUNDO_SEG,DS_RESUMO,FL_MAIOR_VENDA,FL_APORTE_OBRIG,FL_CONTRIB_OBRIG,FL_VISAO_CLIENTE,FL_ATIVO,VL_APORTE, VL_CONTRIBUICAO,COR)values(         533,          1,           null,          null,          5,         4,         'ICATU SEG GLOBAL EQUITY INCOME 10 FI MUL',          'GLOBA',          'O fundo nasceu da parceria entre a Icatu Seguros e BlackRock. O fundo investe em uma carteira diversificada composta por títulos atrelados à inflação com vencimento inferior a 5 anos e de ações globais de alta qualidade (até 10% do PL). A gestão do fundo fica a cargo da Icatu Vanguarda que faz a alocação da parte de renda fixa brasileira e investe, via veículos locais, em uma estratégia de ações globais da BlackRock. A diversificação é o grande diferencial do produto, a estratégia gerida pela BlackRock oferece uma diversificação geográfica e setorial muito mais ampla que o investimento em renda variável local. Além disso, a alocação em ativos atrelados a índice de preços proporciona ganho real e proteção contra a inflação. Fatores que tornam o fundo atrativo para investimento de longo prazo.',          null,       'S' ,         'S' ,          'S',          'S',          '5000,00'      ,            '300,00'     ,      null          );
insert into TB_INVESTIMENTO (ID,PID_TIPO_INVESTIMENTO,PID_RISCO_PRE_FORMAT,PID_TIPO_RISCO,PID_PRODUTO,PID_EMPRESA,NM_INVESTIMENTO, CD_FUNDO_SEG,DS_RESUMO,FL_MAIOR_VENDA,FL_APORTE_OBRIG,FL_CONTRIB_OBRIG,FL_VISAO_CLIENTE,FL_ATIVO,VL_APORTE, VL_CONTRIBUICAO,COR)values(         23423,          1,           null,          null,          6,         4,         'APEX LONG BIASED ICATU PREV FIM 70',          'APE70',          'Fundo de previdência gerido pela Apex Capital. A estratégia consiste no conceito de que não é preciso que a totalidade do patrimônio de renda variável esteja em posição comprada para alcançar a valorização superior ao índice. O fundo se beneficia da queda dos preços das ações na parcela vendida e a diversificação entre as posições resulta em uma menor volatilidade. O PL restante do fundo é alocado em títulos públicos pós-fixados e indexados ao IPCA. Pode alocar até 70% de seu PL em renda variável.',          null,       'S' ,         'S' ,          'S',          'N',          '5000,00'      ,            '300,00'     ,      null          );
insert into TB_INVESTIMENTO (ID,PID_TIPO_INVESTIMENTO,PID_RISCO_PRE_FORMAT,PID_TIPO_RISCO,PID_PRODUTO,PID_EMPRESA,NM_INVESTIMENTO, CD_FUNDO_SEG,DS_RESUMO,FL_MAIOR_VENDA,FL_APORTE_OBRIG,FL_CONTRIB_OBRIG,FL_VISAO_CLIENTE,FL_ATIVO,VL_APORTE, VL_CONTRIBUICAO,COR)values(         586,          1,           null,          null,          6,         4,         'ICATU SEG FIC FI RF PLUS',          'SBC00',          'Esse fundo é uma opção com mais risco de mercado que os fundos anteriores, ele compra cotas do ICATU SEG FI RENDA FIXA PLUS PREVIDENCIÁRIO (17.329.683/0001-28) de gestão da Icatu Vanguarda.',          null,       'S' ,         'S' ,          'S',          'S',          '10000,00'      ,            '800,00'     ,      null          );
insert into TB_INVESTIMENTO (ID,PID_TIPO_INVESTIMENTO,PID_RISCO_PRE_FORMAT,PID_TIPO_RISCO,PID_PRODUTO,PID_EMPRESA,NM_INVESTIMENTO, CD_FUNDO_SEG,DS_RESUMO,FL_MAIOR_VENDA,FL_APORTE_OBRIG,FL_CONTRIB_OBRIG,FL_VISAO_CLIENTE,FL_ATIVO,VL_APORTE, VL_CONTRIBUICAO,COR)values(         590,          1,           null,          null,          6,         4,         'ICATU SEG INFLAÇÃO FI RF',          'PGIGP',          'É um fundo que compra basicamente títulos públicos e privados indexados à inflação. O fundo busca ter exposição tanto a IGP-M quanto IPCA. Apresenta volatilidade elevada apesar de ser de renda fixa. Essa característica deve-se a necessidade de marcar a mercado os títulos que compõem a carteira do fundo, isto é, os papéis devem ter o seu valor de venda atualizados diariamente mesmo que sejam carregados até o vencimento. As NTN-Bs por possuírem um caráter pré-fixado apresentam variação no seu preço unitário conforme alterações nas expectativas de juros futuras, de maneira geral, se há expectativa de subida nas taxas de juros os preços dos títulos caem e se há expectativa de queda nas taxas de juros os preços sobem.',          null,       'S' ,         'S' ,          'S',          'S',          '1000,00'      ,            '100,00'     ,      null          );
insert into TB_INVESTIMENTO (ID,PID_TIPO_INVESTIMENTO,PID_RISCO_PRE_FORMAT,PID_TIPO_RISCO,PID_PRODUTO,PID_EMPRESA,NM_INVESTIMENTO, CD_FUNDO_SEG,DS_RESUMO,FL_MAIOR_VENDA,FL_APORTE_OBRIG,FL_CONTRIB_OBRIG,FL_VISAO_CLIENTE,FL_ATIVO,VL_APORTE, VL_CONTRIBUICAO,COR)values(         593,          1,           null,          null,          6,         4,         'IS MINHA APOSENTADORIA 2020 FIC FIM',          'MAP02',          'Fundo data-alvo gerido pela Icatu Vanguarda. O fundo tenta replicar o ciclo de vida de um cliente que se torna mais conservador a medida que se aproxima da sua data aposentadoria, da mesma forma, o fundo vai diminuindo a sua volatilidade conforme se aproxima da data-alvo. A estratégia é dinâmica e não há necessidade, por parte do cliente, de readequar a sua carteira por grau de risco ou fazer revisões periódicas.',          null,       'S' ,         'S' ,          'S',          'S',          '1000,00'      ,            '100,00'     ,      null          );
insert into TB_INVESTIMENTO (ID,PID_TIPO_INVESTIMENTO,PID_RISCO_PRE_FORMAT,PID_TIPO_RISCO,PID_PRODUTO,PID_EMPRESA,NM_INVESTIMENTO, CD_FUNDO_SEG,DS_RESUMO,FL_MAIOR_VENDA,FL_APORTE_OBRIG,FL_CONTRIB_OBRIG,FL_VISAO_CLIENTE,FL_ATIVO,VL_APORTE, VL_CONTRIBUICAO,COR)values(         543,          1,           null,          null,          5,         4,         'ICATU SEG PRIVILEGE RF FIC FI',          'MANGA',          'O fundo compra cotas do fundo ICATU SEG FI RENDA FIXA PREVIDENCIÁRIO (07.376.622/0001-68) que é gerido pela Icatu Vanguarda. O fundo máster compra basicamente títulos pós-fixados e possui exposição a crédito privado e títulos com risco de mercado mais elevada que os fundos conservadores, mas ainda assim apresenta baixa volatilidade.',          null,       'S' ,         'S' ,          'S',          'S',          '30000,00'      ,            null     ,      null          );
insert into TB_INVESTIMENTO (ID,PID_TIPO_INVESTIMENTO,PID_RISCO_PRE_FORMAT,PID_TIPO_RISCO,PID_PRODUTO,PID_EMPRESA,NM_INVESTIMENTO, CD_FUNDO_SEG,DS_RESUMO,FL_MAIOR_VENDA,FL_APORTE_OBRIG,FL_CONTRIB_OBRIG,FL_VISAO_CLIENTE,FL_ATIVO,VL_APORTE, VL_CONTRIBUICAO,COR)values(         505,          1,           null,          null,          5,         4,         'ARGUCIA ENDOWMENT FIM',          'ARGMM',          'Fundo de previdência multimercado gerido pela Argucia Capital Management. A filosofia do fundo é pautada no conceito de preservação de capital e renda. O objetivo do fundo é auferir rendimentos superiores à taxa de juros real no longo prazo mediante aplicação em ativos de diferentes naturezas e características. A seleção dos ativos e alocação entre os mercados são guiadas pela análise da capacidade de retorno dos investimentos, orientados pelo valor da empresa e seu fluxo de caixa futuro, guiada por uma sólida, disciplinada, mas flexível, análise da capacidade de retorno dos investimentos.',          null,       'S' ,         'S' ,          'S',          'S',          '5000,00'      ,            '300,00'     ,      null          );
insert into TB_INVESTIMENTO (ID,PID_TIPO_INVESTIMENTO,PID_RISCO_PRE_FORMAT,PID_TIPO_RISCO,PID_PRODUTO,PID_EMPRESA,NM_INVESTIMENTO, CD_FUNDO_SEG,DS_RESUMO,FL_MAIOR_VENDA,FL_APORTE_OBRIG,FL_CONTRIB_OBRIG,FL_VISAO_CLIENTE,FL_ATIVO,VL_APORTE, VL_CONTRIBUICAO,COR)values(         585,          1,           null,          null,          6,         4,         'ICATU SEG FIC FI RF INFLAÇÃO CURTA',          'RREAL',          'É um fundo que investe em títulos públicos e privados indexados à inflação com vencimentos inferiores a 5 anos. A carteira do fundo busca replicar a composição do IMA-B 5 tendo duration e yield próximos ao índice. Apresenta volatilidade moderada apesar de ser de renda fixa. Essa característica deve-se a necessidade de marcar a mercado os títulos que compõem a carteira do fundo, isto é, os papéis devem ter o seu valor de venda atualizados diariamente mesmo que sejam carregados até o vencimento. As NTN-Bs por possuírem um caráter pré-fixado apresentam variação no seu preço unitário conforme alterações nas expectativas de juros futuras, de maneira geral se há expectativa de subida nas taxas de juros os preços dos títulos caem e se há expectativa de queda nas taxas de juros os preços sobem.',          null,       'S' ,         'S' ,          'S',          'S',          '5000,00'      ,            '300,00'     ,      null          );
insert into TB_INVESTIMENTO (ID,PID_TIPO_INVESTIMENTO,PID_RISCO_PRE_FORMAT,PID_TIPO_RISCO,PID_PRODUTO,PID_EMPRESA,NM_INVESTIMENTO, CD_FUNDO_SEG,DS_RESUMO,FL_MAIOR_VENDA,FL_APORTE_OBRIG,FL_CONTRIB_OBRIG,FL_VISAO_CLIENTE,FL_ATIVO,VL_APORTE, VL_CONTRIBUICAO,COR)values(         584,          1,           null,          null,          6,         4,         'ICATU SEG FICFI PRIVILEGE CONSERVADOR RF',          'FCFII',          'O fundo compra cotas do fundo Icatu Seg FI RF Conservador Previdenciário (10.157.661/0001-89) que é gerido pela Icatu Vanguarda. O fundo máster compra basicamente títulos públicos pós-fixados e possui baixa exposição a crédito privado e títulos com risco de mercado. O gráfico 1 compara o grau de risco de mercado do fundo com o FI Moderado Previdenciário e o FI Plus.',          null,       'S' ,         'S' ,          'S',          'S',          '30000,00'      ,            null     ,      null          );
insert into TB_INVESTIMENTO (ID,PID_TIPO_INVESTIMENTO,PID_RISCO_PRE_FORMAT,PID_TIPO_RISCO,PID_PRODUTO,PID_EMPRESA,NM_INVESTIMENTO, CD_FUNDO_SEG,DS_RESUMO,FL_MAIOR_VENDA,FL_APORTE_OBRIG,FL_CONTRIB_OBRIG,FL_VISAO_CLIENTE,FL_ATIVO,VL_APORTE, VL_CONTRIBUICAO,COR)values(         512,          1,           null,          null,          5,         4,         'OCCAM ICATU PREV FIC FIM',          'PLURA',          'Fundo de previdência multimercado gerido pela Occam Brasil. O OCCAM ICATU PREV FIM busca alocar, em condições normais de mercado, dois terços do risco em estratégias de renda variável (long/short) e um terço do risco em estratégias de juros/inflação/câmbio, respeitando as regras da legislação vigente para as Entidades Abertas de Previdência.',          null,       'S' ,         'S' ,          'S',          'S',          '5000,00'      ,            '300,00'     ,      null          );
insert into TB_INVESTIMENTO (ID,PID_TIPO_INVESTIMENTO,PID_RISCO_PRE_FORMAT,PID_TIPO_RISCO,PID_PRODUTO,PID_EMPRESA,NM_INVESTIMENTO, CD_FUNDO_SEG,DS_RESUMO,FL_MAIOR_VENDA,FL_APORTE_OBRIG,FL_CONTRIB_OBRIG,FL_VISAO_CLIENTE,FL_ATIVO,VL_APORTE, VL_CONTRIBUICAO,COR)values(         571,          1,           null,          null,          6,         4,         'CSHG GAUSS ICATU PREV FIC FIM',          'C1791',          'O fundo CSHG Gauss Icatu Prev FIC FIM conta com a gestão da CSHG Asset Management. A gestão é baseada na mesma filosofia e estratégia de investimento adotada no segmento multimercado da gestora, do qual o CSHG Gauss Master FIM – lançado em dez de 2014 – integra. O CSHG Gauss Icatu Prev FIC FIM tem por objetivo buscar retorno através de investimentos em diversas classes de ativos financeiros disponíveis nos mercados de renda fixa, renda variável, cambial, derivativos e cotas de fundos de investimento, negociados nos mercados interno e externo, sem o compromisso de concentração em nenhuma classe específica.',          null,       'S' ,         'S' ,          'S',          'S',          '5000,00'      ,            '300,00'     ,      null          );
insert into TB_INVESTIMENTO (ID,PID_TIPO_INVESTIMENTO,PID_RISCO_PRE_FORMAT,PID_TIPO_RISCO,PID_PRODUTO,PID_EMPRESA,NM_INVESTIMENTO, CD_FUNDO_SEG,DS_RESUMO,FL_MAIOR_VENDA,FL_APORTE_OBRIG,FL_CONTRIB_OBRIG,FL_VISAO_CLIENTE,FL_ATIVO,VL_APORTE, VL_CONTRIBUICAO,COR)values(         544,          1,           null,          null,          5,         4,         'ICATU SEG TESOURO JURO REAL 2024 FICFIRF',          'JR024',          'O Tesouro IPCA+ (NTN-B 2024) é um título pós-fixado, cuja rentabilidade é composta por uma taxa anual (Yield) pactuada no momento da compra mais a variação do IPCA (Índice de Preços ao Consumidor Amplo), índice de inflação oficial do governo brasileiro. O fundo visa replicar a rentabilidade da NTN-B 2024 (menos os custos do fundo), proporcionando rentabilidade real, ou seja, preservando o aumento de poder de compra do seu dinheiro. Esse investimento se destina a investidores com investimentos com vencimentos em torno de 2024 e que tolerem oscilação de cotas em janelas mais curtas.',          null,       'S' ,         'S' ,          'S',          'S',          '10000,00'      ,            '800,00'     ,      null          );
insert into TB_INVESTIMENTO (ID,PID_TIPO_INVESTIMENTO,PID_RISCO_PRE_FORMAT,PID_TIPO_RISCO,PID_PRODUTO,PID_EMPRESA,NM_INVESTIMENTO, CD_FUNDO_SEG,DS_RESUMO,FL_MAIOR_VENDA,FL_APORTE_OBRIG,FL_CONTRIB_OBRIG,FL_VISAO_CLIENTE,FL_ATIVO,VL_APORTE, VL_CONTRIBUICAO,COR)values(         600,          1,           null,          null,          6,         4,         'ICATU SEG TESOURO JURO REAL 2024 FICFIRF',          'JR024',          'O Tesouro IPCA+ (NTN-B 2024) é um título pós-fixado, cuja rentabilidade é composta por uma taxa anual (Yield) pactuada no momento da compra mais a variação do IPCA (Índice de Preços ao Consumidor Amplo), índice de inflação oficial do governo brasileiro. O fundo visa replicar a rentabilidade da NTN-B 2024 (menos os custos do fundo), proporcionando rentabilidade real, ou seja, preservando o aumento de poder de compra do seu dinheiro. Esse investimento se destina a investidores com investimentos com vencimentos em torno de 2024 e que tolerem oscilação de cotas em janelas mais curtas.',          null,       'S' ,         'S' ,          'S',          'S',          '10000,00'      ,            '800,00'     ,      null          );
insert into TB_INVESTIMENTO (ID,PID_TIPO_INVESTIMENTO,PID_RISCO_PRE_FORMAT,PID_TIPO_RISCO,PID_PRODUTO,PID_EMPRESA,NM_INVESTIMENTO, CD_FUNDO_SEG,DS_RESUMO,FL_MAIOR_VENDA,FL_APORTE_OBRIG,FL_CONTRIB_OBRIG,FL_VISAO_CLIENTE,FL_ATIVO,VL_APORTE, VL_CONTRIBUICAO,COR)values(         609,          1,           null,          null,          6,         4,         'ALASKA 70 ICATU PREV FIM',          'ALASK',          'O ALASKA 70 ICATU PREV FIM é um fundo gerido pela Alaska Asset Management. Trata-se de um fundo multimercado no qual 70% do seu PL é alocado em uma estratégia de renda variável e o restante alocado em renda fixa. O objetivo do fundo é investir em empresas de qualidade, administradas por pessoas competentes e confiáveis e obter retorno sobre o capital do fundo através da geração de caixa das empresas investidas.',          null,       'S' ,         'S' ,          'S',          'S',          '5000,00'      ,            '300,00'     ,      null          );
insert into TB_INVESTIMENTO (ID,PID_TIPO_INVESTIMENTO,PID_RISCO_PRE_FORMAT,PID_TIPO_RISCO,PID_PRODUTO,PID_EMPRESA,NM_INVESTIMENTO, CD_FUNDO_SEG,DS_RESUMO,FL_MAIOR_VENDA,FL_APORTE_OBRIG,FL_CONTRIB_OBRIG,FL_VISAO_CLIENTE,FL_ATIVO,VL_APORTE, VL_CONTRIBUICAO,COR)values(         23434,          1,           null,          null,          5,         4,         'TRUXT MACRO PREV ICATU FIC FIM',          'TRUXT',          'Fundo de previdência com gestão da Truxt Investimentos. Trata-se de um fundo previdenciário multimercado com estratégia macro que busca replicar a mesma carteira do fundo TRUXT MACRO respeitando as restrições legais da regulação de previdência. A estratégia macro alia a análise fundamentalista, considerando os cenários macroeconômico de médio e longo prazo e identificação de tendências dos ciclos econômicos, com a visão oportunistíca e o monitoramento constante do risco. O fundo tem por objetivo a geração de retorno no longo prazo e a preservação do capital do participante a partir de uma carteira com flexibilidade da alocação de risco total, entre os diversos mercados e estratégias.',          null,       'S' ,         'S' ,          'S',          'S',          '5000,00'      ,            '300,00'     ,      null          );
insert into TB_INVESTIMENTO (ID,PID_TIPO_INVESTIMENTO,PID_RISCO_PRE_FORMAT,PID_TIPO_RISCO,PID_PRODUTO,PID_EMPRESA,NM_INVESTIMENTO, CD_FUNDO_SEG,DS_RESUMO,FL_MAIOR_VENDA,FL_APORTE_OBRIG,FL_CONTRIB_OBRIG,FL_VISAO_CLIENTE,FL_ATIVO,VL_APORTE, VL_CONTRIBUICAO,COR)values(         23433,          1,           null,          null,          6,         4,         'SPARTA PREV ICATU D FIC FI RF CP',          'SPARD',          'Trata-se de um fundo previdenciário de crédito privado com a mesma equipe de gestão consagrada pelo fundo Sparta Top e conta com uma grande pulverização de seus ativos nesse produto. No momento da análise do investimento, considera-se tanto o emissor quanto o ativo em si. O fundo tem o objetivo de obter retornos consistentes, buscando superar a rentabilidade do CDI. A política de investimento do fundo Sparta Previdência Icatu consiste em investir em ativos de renda fixa e cotas de fundos de investimento de renda fixa ou direitos creditórios, com perfil pós-fixado, pré-fixado ou indexado a índices de preços, podendo utilizar instrumentos que resultem em troca de indexador, buscando um perfil de retorno pós-fixado e mantendo um perfil de atuação conservador. O objetivo do FUNDO é obter retornos consistentes, buscando superar a rentabilidade do CDI.',          null,       'S' ,         'S' ,          'S',          'S',          '30000,00'      ,            null     ,      null          );
insert into TB_INVESTIMENTO (ID,PID_TIPO_INVESTIMENTO,PID_RISCO_PRE_FORMAT,PID_TIPO_RISCO,PID_PRODUTO,PID_EMPRESA,NM_INVESTIMENTO, CD_FUNDO_SEG,DS_RESUMO,FL_MAIOR_VENDA,FL_APORTE_OBRIG,FL_CONTRIB_OBRIG,FL_VISAO_CLIENTE,FL_ATIVO,VL_APORTE, VL_CONTRIBUICAO,COR)values(         580,          1,           null,          null,          6,         4,         'ICATU SEG COMPOSTO 20E FIC FIM',          'PGE20',          'Fundo de previdência balanceado gerido pela Icatu Vanguarda. O fundo balanceado é um tipo particular de multimercado que investe somente em renda variável e renda fixa em uma proporção definida. O fundo se caracteriza por ter uma parcela de renda variável que busca replicar a rentabilidade do Ibovespa e ter uma parcela de renda fixa com gestão ativa. Pode aplicar até 20% em renda variável.',          null,       'S' ,         'S' ,          'S',          'S',          '1000,00'      ,            '100,00'     ,      null          );
insert into TB_INVESTIMENTO (ID,PID_TIPO_INVESTIMENTO,PID_RISCO_PRE_FORMAT,PID_TIPO_RISCO,PID_PRODUTO,PID_EMPRESA,NM_INVESTIMENTO, CD_FUNDO_SEG,DS_RESUMO,FL_MAIOR_VENDA,FL_APORTE_OBRIG,FL_CONTRIB_OBRIG,FL_VISAO_CLIENTE,FL_ATIVO,VL_APORTE, VL_CONTRIBUICAO,COR)values(         596,          1,           null,          null,          6,         4,         'ICATU SEG MODERADO E FIC DE FI RF',          'PGE00',          'O fundo compra cotas do fundo ICATU SEG FI RENDA FIXA PREVIDENCIÁRIO (07.376.622/0001-68) que é gerido pela Icatu Vanguarda. O fundo máster compra basicamente títulos pós-fixados e possui exposição a crédito privado e títulos com risco de mercado mais elevada que os fundos conservadores, mas ainda assim apresenta baixa volatilidade.',          null,       'S' ,         'S' ,          'S',          'S',          '1000,00'      ,            '100,00'     ,      null          );
insert into TB_INVESTIMENTO (ID,PID_TIPO_INVESTIMENTO,PID_RISCO_PRE_FORMAT,PID_TIPO_RISCO,PID_PRODUTO,PID_EMPRESA,NM_INVESTIMENTO, CD_FUNDO_SEG,DS_RESUMO,FL_MAIOR_VENDA,FL_APORTE_OBRIG,FL_CONTRIB_OBRIG,FL_VISAO_CLIENTE,FL_ATIVO,VL_APORTE, VL_CONTRIBUICAO,COR)values(         530,          1,           null,          null,          5,         4,         'ICATU SEG FIC FI RF PLUS',          'SBC00',          'Esse fundo é uma opção com mais risco de mercado que os fundos anteriores, ele compra cotas do ICATU SEG FI RENDA FIXA PLUS PREVIDENCIÁRIO (17.329.683/0001-28) de gestão da Icatu Vanguarda.',          null,       'S' ,         'S' ,          'S',          'S',          '10000,00'      ,            '800,00'     ,      null          );
insert into TB_INVESTIMENTO (ID,PID_TIPO_INVESTIMENTO,PID_RISCO_PRE_FORMAT,PID_TIPO_RISCO,PID_PRODUTO,PID_EMPRESA,NM_INVESTIMENTO, CD_FUNDO_SEG,DS_RESUMO,FL_MAIOR_VENDA,FL_APORTE_OBRIG,FL_CONTRIB_OBRIG,FL_VISAO_CLIENTE,FL_ATIVO,VL_APORTE, VL_CONTRIBUICAO,COR)values(         561,          1,           null,          null,          6,         4,         'ARGUCIA ENDOWMENT FIM',          'ARGMM',          'Fundo de previdência multimercado gerido pela Argucia Capital Management. A filosofia do fundo é pautada no conceito de preservação de capital e renda. O objetivo do fundo é auferir rendimentos superiores à taxa de juros real no longo prazo mediante aplicação em ativos de diferentes naturezas e características. A seleção dos ativos e alocação entre os mercados são guiadas pela análise da capacidade de retorno dos investimentos, orientados pelo valor da empresa e seu fluxo de caixa futuro, guiada por uma sólida, disciplinada, mas flexível, análise da capacidade de retorno dos investimentos.',          null,       'S' ,         'S' ,          'S',          'S',          '5000,00'      ,            '300,00'     ,      null          );
insert into TB_INVESTIMENTO (ID,PID_TIPO_INVESTIMENTO,PID_RISCO_PRE_FORMAT,PID_TIPO_RISCO,PID_PRODUTO,PID_EMPRESA,NM_INVESTIMENTO, CD_FUNDO_SEG,DS_RESUMO,FL_MAIOR_VENDA,FL_APORTE_OBRIG,FL_CONTRIB_OBRIG,FL_VISAO_CLIENTE,FL_ATIVO,VL_APORTE, VL_CONTRIBUICAO,COR)values(         582,          1,           null,          null,          6,         4,         'SANTANDER ICATU LARK I CP FIC FIE RF',          'DYNAM',          'Fundo de renda fixa com gestão da Santander Asset. O fundo busca elevados retornos a partir de uma gestão ativa em renda fixa investindo nos mercados locais e offshore de juros e crédito. A volatilidade do fundo é de baixa a moderada, podendo aumentar a exposição a risco de mercado em momentos oportunos.',          null,       'S' ,         'S' ,          'S',          'S',          '30000,00'      ,            null     ,      null          );
insert into TB_INVESTIMENTO (ID,PID_TIPO_INVESTIMENTO,PID_RISCO_PRE_FORMAT,PID_TIPO_RISCO,PID_PRODUTO,PID_EMPRESA,NM_INVESTIMENTO, CD_FUNDO_SEG,DS_RESUMO,FL_MAIOR_VENDA,FL_APORTE_OBRIG,FL_CONTRIB_OBRIG,FL_VISAO_CLIENTE,FL_ATIVO,VL_APORTE, VL_CONTRIBUICAO,COR)values(         532,          1,           null,          null,          5,         4,         'ICATU SEG FRANKLIN TEMPLETON PREV FIM',          'FRANK',          'Fundo de previdência multimercado gerido pela Franklin Templeton Investimentos. O fundo tem por objetivo buscar a valorização dos capitais investidos no longo prazo, mediante a utilização de estratégia de investimento diversificada, que envolve vários fatores de risco, sem o compromisso de concentração em nenhum ativo ou fator de risco em especial e com utilização de operações em mercado de derivativos, sem alavancagem, com o objetivo de superar o CDI. É importante destacar que o fundo não tem posições em renda variável, é um fundo basicamente de juros e moedas.',          null,       'S' ,         'S' ,          'S',          'S',          '5000,00'      ,            '300,00'     ,      null          );
