insert into TB_INVESTIMENTO (ID,PID_TIPO_INVESTIMENTO,PID_RISCO_PRE_FORMAT,PID_TIPO_RISCO,PID_PRODUTO,PID_EMPRESA,NM_INVESTIMENTO, CD_FUNDO_SEG,DS_RESUMO,FL_MAIOR_VENDA,FL_APORTE_OBRIG,FL_CONTRIB_OBRIG,FL_VISAO_CLIENTE,FL_ATIVO,VL_APORTE, VL_CONTRIBUICAO,COR)values(         606,          1,           null,          null,          6,         4,         'VERDE AM ICATU PREVIDÊNCIA FIC FIM PREV',          'VERDE',          'Fundo de previdência multimercado gerido pela Verde AM. A Verde Asset conta com a liderança do renomado Luis Stuhlberger e possui R$ 33 bilhões (PL aproximado em ago/2017) sob gestão sendo uma das maiores gestoras independentes do mercado. A filosofia de investimento da casa baseia-se em estudo e trabalho intenso de pesquisa e em um processo profundo de análises macro e microeconômicas com viés fundamentalista, contemplando o mercado local e internacional. O VERDE AM ICATU PREV FIC FIM PREV investe principalmente em renda variável local e global, câmbio e renda fixa.',          null,       'S' ,         'S' ,          'S',          'S',          '5000,00'      ,            '300,00'     ,      null          );
