insert into TB_INVESTIMENTO (ID,PID_TIPO_INVESTIMENTO,PID_RISCO_PRE_FORMAT,PID_TIPO_RISCO,PID_PRODUTO,PID_EMPRESA,NM_INVESTIMENTO, CD_FUNDO_SEG,DS_RESUMO,FL_MAIOR_VENDA,FL_APORTE_OBRIG,FL_CONTRIB_OBRIG,FL_VISAO_CLIENTE,FL_ATIVO,VL_APORTE, VL_CONTRIBUICAO,COR)values(         513,          1,           null,          null,          5,         4,         'CANVAS ICATU PREV FIC FI MULT PREV',          'CANVA',          'O objetivo do fundo CANVAS ICATU PREVIDÊNCIA FIC FI MULT PREV é preservação de capital com geração de retorno absoluto no longo prazo. Os investimentos são feitos apenas em mercados líquidos, com foco na estratégia multimercado macro e uso seletivo de crédito. A equipe da Canvas Capital tem um histórico de 10 anos com forte geração de ganhos em diversos mercados, dentro de um processo de investimento disciplinado e de uma plataforma robusta de governança corporativa e compliance.',          null,       'S' ,         'S' ,          'S',          'S',          '5000,00'      ,            '300,00'     ,      null          );
insert into TB_INVESTIMENTO (ID,PID_TIPO_INVESTIMENTO,PID_RISCO_PRE_FORMAT,PID_TIPO_RISCO,PID_PRODUTO,PID_EMPRESA,NM_INVESTIMENTO, CD_FUNDO_SEG,DS_RESUMO,FL_MAIOR_VENDA,FL_APORTE_OBRIG,FL_CONTRIB_OBRIG,FL_VISAO_CLIENTE,FL_ATIVO,VL_APORTE, VL_CONTRIBUICAO,COR)values(         559,          1,           null,          null,          6,         4,         'ADAM ICATU PREVIDENCIÁRIO FIC FIM',          'C1741',          'Fundo de previdência multimercado gerido pela Adam Capital. O objetivo do fundo é a geração de retorno em diversos mercados e classes de ativos (juros, moedas e índice de bolsas), sem preferência por tipo de ativo e independente de direções específicas de movimento, buscando rentabilidade acima do Certificado de Depósito Interbancário - CDI. Márcio Appel, sócio responsável pela Gestão, possui 20 anos de experiência no mercado financeiro, obtendo resultados de sucesso em diversos cenários e mercados. A gestora atingiu mais de R$ 5 bilhões de ativos sobre gestão em menos de 6 meses e o fundo de previdência da estratégia atingiu PL superior a R$ 1 bilhão em menos de 1 ano e meio.',          null,       'S' ,         'S' ,          'S',          'S',          '5000,00'      ,            '300,00'     ,      null          );
insert into TB_INVESTIMENTO (ID,PID_TIPO_INVESTIMENTO,PID_RISCO_PRE_FORMAT,PID_TIPO_RISCO,PID_PRODUTO,PID_EMPRESA,NM_INVESTIMENTO, CD_FUNDO_SEG,DS_RESUMO,FL_MAIOR_VENDA,FL_APORTE_OBRIG,FL_CONTRIB_OBRIG,FL_VISAO_CLIENTE,FL_ATIVO,VL_APORTE, VL_CONTRIBUICAO,COR)values(         547,          1,           null,          null,          5,         4,         'NAVI LONG SHORT ICATU PREV FIM',          'KONDO',          'O fundo adota uma estratégia Long Short, que consiste em uma operação casada, na qual se mantêm uma posição vendida em uma ação e comprada em outra no intuito de obter um residual financeiro da operação quando liquidá-la.',          null,       'S' ,         'S' ,          'S',          'N',          '5000,00'      ,            '300,00'     ,      null          );
insert into TB_INVESTIMENTO (ID,PID_TIPO_INVESTIMENTO,PID_RISCO_PRE_FORMAT,PID_TIPO_RISCO,PID_PRODUTO,PID_EMPRESA,NM_INVESTIMENTO, CD_FUNDO_SEG,DS_RESUMO,FL_MAIOR_VENDA,FL_APORTE_OBRIG,FL_CONTRIB_OBRIG,FL_VISAO_CLIENTE,FL_ATIVO,VL_APORTE, VL_CONTRIBUICAO,COR)values(         524,          1,           null,          null,          5,         4,         'ICATU SEG COMPOSTO 20E FIC FIM',          'PGE20',          'Fundo de previdência balanceado gerido pela Icatu Vanguarda. O fundo balanceado é um tipo particular de multimercado que investe somente em renda variável e renda fixa em uma proporção definida. O fundo se caracteriza por ter uma parcela de renda variável que busca replicar a rentabilidade do Ibovespa e ter uma parcela de renda fixa com gestão ativa. Pode aplicar até 20% em renda variável.',          null,       'S' ,         'S' ,          'S',          'S',          '1000,00'      ,            '100,00'     ,      null          );
insert into TB_INVESTIMENTO (ID,PID_TIPO_INVESTIMENTO,PID_RISCO_PRE_FORMAT,PID_TIPO_RISCO,PID_PRODUTO,PID_EMPRESA,NM_INVESTIMENTO, CD_FUNDO_SEG,DS_RESUMO,FL_MAIOR_VENDA,FL_APORTE_OBRIG,FL_CONTRIB_OBRIG,FL_VISAO_CLIENTE,FL_ATIVO,VL_APORTE, VL_CONTRIBUICAO,COR)values(         579,          1,           null,          null,          6,         4,         'ICATU SEG CLASSIC FIC FI RF',          'PGIHC',          'Esse fundo compra cotas do fundo ICATU SEG FI RENDA FIXA PREVIDENCIÁRIO (07.376.622/0001-68) que é gerido pela Icatu Vanguarda. O fundo máster compra basicamente títulos pós-fixados e possui exposição a crédito privado e títulos com risco de mercado mais elevada que os fundos conservadores, mas ainda assim apresenta baixa volatilidade.',          null,       'S' ,         'S' ,          'S',          'S',          '5000,00'      ,            '300,00'     ,      null          );
insert into TB_INVESTIMENTO (ID,PID_TIPO_INVESTIMENTO,PID_RISCO_PRE_FORMAT,PID_TIPO_RISCO,PID_PRODUTO,PID_EMPRESA,NM_INVESTIMENTO, CD_FUNDO_SEG,DS_RESUMO,FL_MAIOR_VENDA,FL_APORTE_OBRIG,FL_CONTRIB_OBRIG,FL_VISAO_CLIENTE,FL_ATIVO,VL_APORTE, VL_CONTRIBUICAO,COR)values(         595,          1,           null,          null,          6,         4,         'IS MINHA APOSENTADORIA 2040 FIC FIM',          'MAP04',          'Fundo data-alvo gerido pela Icatu Vanguarda. O fundo tenta replicar o ciclo de vida de um cliente que se torna mais conservador a medida que se aproxima da sua data aposentadoria, da mesma forma, o fundo vai diminuindo a sua volatilidade conforme se aproxima da data-alvo. A estratégia é dinâmica e não há necessidade, por parte do cliente, de readequar a sua carteira por grau de risco ou fazer revisões periódicas.',          null,       'S' ,         'S' ,          'S',          'S',          '1000,00'      ,            '100,00'     ,      null          );
insert into TB_INVESTIMENTO (ID,PID_TIPO_INVESTIMENTO,PID_RISCO_PRE_FORMAT,PID_TIPO_RISCO,PID_PRODUTO,PID_EMPRESA,NM_INVESTIMENTO, CD_FUNDO_SEG,DS_RESUMO,FL_MAIOR_VENDA,FL_APORTE_OBRIG,FL_CONTRIB_OBRIG,FL_VISAO_CLIENTE,FL_ATIVO,VL_APORTE, VL_CONTRIBUICAO,COR)values(         594,          1,           null,          null,          6,         4,         'IS MINHA APOSENTADORIA 2030 FIC FIM',          'MAP03',          'Fundo data-alvo gerido pela Icatu Vanguarda. O fundo tenta replicar o ciclo de vida de um cliente que se torna mais conservador a medida que se aproxima da sua data aposentadoria, da mesma forma, o fundo vai diminuindo a sua volatilidade conforme se aproxima da data-alvo. A estratégia é dinâmica e não há necessidade, por parte do cliente, de readequar a sua carteira por grau de risco ou fazer revisões periódicas.',          null,       'S' ,         'S' ,          'S',          'S',          '1000,00'      ,            '100,00'     ,      null          );
insert into TB_INVESTIMENTO (ID,PID_TIPO_INVESTIMENTO,PID_RISCO_PRE_FORMAT,PID_TIPO_RISCO,PID_PRODUTO,PID_EMPRESA,NM_INVESTIMENTO, CD_FUNDO_SEG,DS_RESUMO,FL_MAIOR_VENDA,FL_APORTE_OBRIG,FL_CONTRIB_OBRIG,FL_VISAO_CLIENTE,FL_ATIVO,VL_APORTE, VL_CONTRIBUICAO,COR)values(         541,          1,           null,          null,          5,         4,         'ICATU SEG PRIVILEGE COMPOSTO 49 FIC FIM',          'CORUI',          'Fundo de previdência balanceado gerido pela Icatu Vanguarda. O fundo balanceado é um tipo particular de multimercado que investe somente em renda variável e renda fixa em uma proporção definida. O fundo se caracteriza por ter uma parcela de renda variável que busca replicar a rentabilidade do Ibovespa e ter uma parcela de renda fixa com gestão ativa. Pode aplicar até 49% em renda variável.',          null,       'S' ,         'S' ,          'S',          'S',          '30000,00'      ,            null     ,      null          );
