insert into TB_INVESTIMENTO (ID,PID_TIPO_INVESTIMENTO,PID_RISCO_PRE_FORMAT,PID_TIPO_RISCO,PID_PRODUTO,PID_EMPRESA,NM_INVESTIMENTO, CD_FUNDO_SEG,DS_RESUMO,FL_MAIOR_VENDA,FL_APORTE_OBRIG,FL_CONTRIB_OBRIG,FL_VISAO_CLIENTE,FL_ATIVO,VL_APORTE, VL_CONTRIBUICAO,COR)values(         604,          1,           null,          null,          6,         4,         'LEBLON PREVIDÊNCIA FIM',          'LEB01',          'Fundo de previdência multimercado gerido pela Leblon Equities. O objetivo do fundo é atingir elevados retornos absolutos no longo prazo através de uma gestão ativa de investimentos realizados predominantemente nos mercados brasileiros de ações e de renda fixa. O fundo investe até 49% de sua carteira em ações com alto potencial de valorização no longo prazo. O restante da carteira é investido predominantemente em títulos públicos federais.',          null,       'S' ,         'S' ,          'S',          'S',          '5000,00'      ,            '300,00'     ,      null          );
insert into TB_INVESTIMENTO (ID,PID_TIPO_INVESTIMENTO,PID_RISCO_PRE_FORMAT,PID_TIPO_RISCO,PID_PRODUTO,PID_EMPRESA,NM_INVESTIMENTO, CD_FUNDO_SEG,DS_RESUMO,FL_MAIOR_VENDA,FL_APORTE_OBRIG,FL_CONTRIB_OBRIG,FL_VISAO_CLIENTE,FL_ATIVO,VL_APORTE, VL_CONTRIBUICAO,COR)values(         529,          1,           null,          null,          5,         4,         'ICATU SEG FIC FI RF INFLAÇÃO CURTA',          'RREAL',          'É um fundo que investe em títulos públicos e privados indexados à inflação com vencimentos inferiores a 5 anos. A carteira do fundo busca replicar a composição do IMA-B 5 tendo duration e yield próximos ao índice. Apresenta volatilidade moderada apesar de ser de renda fixa. Essa característica deve-se a necessidade de marcar a mercado os títulos que compõem a carteira do fundo, isto é, os papéis devem ter o seu valor de venda atualizados diariamente mesmo que sejam carregados até o vencimento. As NTN-Bs por possuírem um caráter pré-fixado apresentam variação no seu preço unitário conforme alterações nas expectativas de juros futuras, de maneira geral se há expectativa de subida nas taxas de juros os preços dos títulos caem e se há expectativa de queda nas taxas de juros os preços sobem.',          null,       'S' ,         'S' ,          'S',          'S',          '5000,00'      ,            '300,00'     ,      null          );
insert into TB_INVESTIMENTO (ID,PID_TIPO_INVESTIMENTO,PID_RISCO_PRE_FORMAT,PID_TIPO_RISCO,PID_PRODUTO,PID_EMPRESA,NM_INVESTIMENTO, CD_FUNDO_SEG,DS_RESUMO,FL_MAIOR_VENDA,FL_APORTE_OBRIG,FL_CONTRIB_OBRIG,FL_VISAO_CLIENTE,FL_ATIVO,VL_APORTE, VL_CONTRIBUICAO,COR)values(         536,          1,           null,          null,          5,         4,         'ICATU SEG KADIMA FIM CP PREVIDÊNCIA',          'KADIM',          'É o único fundo de previdência quantitativo do Brasil, a gestão fica a cargo da Kadima Asset Management. O gestor utiliza algoritmos computacionais para auxiliar na composição da carteira do fundo, esses algoritmos tentam identificar tendências de curto e médio prazo e arbitrar em cima de ineficiências de mercado. A estratégia possui baixa correlação com a maioria das estratégias oferecidas em fundos de previdência sendo um bom veículo de diversificação da carteira.',          null,       'S' ,         'S' ,          'S',          'S',          '5000,00'      ,            '300,00'     ,      null          );
insert into TB_INVESTIMENTO (ID,PID_TIPO_INVESTIMENTO,PID_RISCO_PRE_FORMAT,PID_TIPO_RISCO,PID_PRODUTO,PID_EMPRESA,NM_INVESTIMENTO, CD_FUNDO_SEG,DS_RESUMO,FL_MAIOR_VENDA,FL_APORTE_OBRIG,FL_CONTRIB_OBRIG,FL_VISAO_CLIENTE,FL_ATIVO,VL_APORTE, VL_CONTRIBUICAO,COR)values(         560,          1,           null,          null,          6,         4,         'APEX LONG BIASED ICATU PREV FIM',          'APEXM',          'Fundo de previdência gerido pela Apex Capital. O APEX LONG BIASED ICATU PREV FIM 49 foi o primeiro fundo de previdência com estratégia de investimento Long Biased. A estratégia consiste no conceito de que não é preciso que a totalidade do patrimônio de renda variável esteja em posição comprada para alcançar a valorização superior ao índice. O fundo se beneficia da queda dos preços das ações na parcela vendida e a diversificação entre as posições resulta em uma menor volatilidade. O PL restante do fundo é alocado em títulos públicos pós-fixados e indexados ao IPCA. Pode alocar até 49% de seu PL em renda variável.',          null,       'S' ,         'S' ,          'S',          'N',          '5000,00'      ,            '300,00'     ,      null          );
insert into TB_INVESTIMENTO (ID,PID_TIPO_INVESTIMENTO,PID_RISCO_PRE_FORMAT,PID_TIPO_RISCO,PID_PRODUTO,PID_EMPRESA,NM_INVESTIMENTO, CD_FUNDO_SEG,DS_RESUMO,FL_MAIOR_VENDA,FL_APORTE_OBRIG,FL_CONTRIB_OBRIG,FL_VISAO_CLIENTE,FL_ATIVO,VL_APORTE, VL_CONTRIBUICAO,COR)values(         565,          1,           null,          null,          6,         4,         'AZ QUEST PREV ICT CONSERVADOR FICFIRFCP',          'AZQRF',          'O fundo busca a geração de retornos superiores e preservação de capital do investidor, através de rigoroso processo de análise fundamentalista e gestão ativa do portfólio de crédito privado. O portfólio do fundo é composto majoritariamente de títulos de emissões bancárias e debentures de baixo risco de crédito privado.',          null,       'S' ,         'S' ,          'S',          'S',          '30000,00'      ,            null     ,      null          );
insert into TB_INVESTIMENTO (ID,PID_TIPO_INVESTIMENTO,PID_RISCO_PRE_FORMAT,PID_TIPO_RISCO,PID_PRODUTO,PID_EMPRESA,NM_INVESTIMENTO, CD_FUNDO_SEG,DS_RESUMO,FL_MAIOR_VENDA,FL_APORTE_OBRIG,FL_CONTRIB_OBRIG,FL_VISAO_CLIENTE,FL_ATIVO,VL_APORTE, VL_CONTRIBUICAO,COR)values(         572,          1,           null,          null,          6,         4,         'DLM ICATU SEG PREVIDÊNCIA FIM CP',          'DLM',          'Fundo multimercado gerido pela DLM Invista. O fundo busca proporcionar ganhos de capital superiores ao rendimento do CDI investindo em uma carteira composta preponderantemente de crédito privado de alta qualidade. A estratégia atual do fundo é preponderam ente de renda fixa sem exposição a moedas ou renda variável.',          null,       'S' ,         'S' ,          'S',          'S',          '5000,00'      ,            '300,00'     ,      null          );
insert into TB_INVESTIMENTO (ID,PID_TIPO_INVESTIMENTO,PID_RISCO_PRE_FORMAT,PID_TIPO_RISCO,PID_PRODUTO,PID_EMPRESA,NM_INVESTIMENTO, CD_FUNDO_SEG,DS_RESUMO,FL_MAIOR_VENDA,FL_APORTE_OBRIG,FL_CONTRIB_OBRIG,FL_VISAO_CLIENTE,FL_ATIVO,VL_APORTE, VL_CONTRIBUICAO,COR)values(         515,          1,           null,          null,          5,         4,         'CSHG GAUSS ICATU PREV FIC FIM',          'C1791',          'O fundo CSHG Gauss Icatu Prev FIC FIM conta com a gestão da CSHG Asset Management. A gestão é baseada na mesma filosofia e estratégia de investimento adotada no segmento multimercado da gestora, do qual o CSHG Gauss Master FIM – lançado em dez de 2014 – integra. O CSHG Gauss Icatu Prev FIC FIM tem por objetivo buscar retorno através de investimentos em diversas classes de ativos financeiros disponíveis nos mercados de renda fixa, renda variável, cambial, derivativos e cotas de fundos de investimento, negociados nos mercados interno e externo, sem o compromisso de concentração em nenhuma classe específica.',          null,       'S' ,         'S' ,          'S',          'S',          '5000,00'      ,            '300,00'     ,      null          );
insert into TB_INVESTIMENTO (ID,PID_TIPO_INVESTIMENTO,PID_RISCO_PRE_FORMAT,PID_TIPO_RISCO,PID_PRODUTO,PID_EMPRESA,NM_INVESTIMENTO, CD_FUNDO_SEG,DS_RESUMO,FL_MAIOR_VENDA,FL_APORTE_OBRIG,FL_CONTRIB_OBRIG,FL_VISAO_CLIENTE,FL_ATIVO,VL_APORTE, VL_CONTRIBUICAO,COR)values(         23428,          1,           null,          null,          5,         4,         'ICATU SEG MACRO FIM PREV',          'MACRO',          'O fundo Icatu Seg Macro Prev é um fundo multimercado que terá gestão compartilhada entre as equipes de multiestratégia e de renda variável da Icatu Vanguarda. As decisões de investimento do fundo são tomadas em conjunto pelos gestores/traders responsáveis por cada uma das áreas a partir de análise macro fundamentada em modelos próprios. O objetivo do fundo é oferecer retornos consistentes no longo prazo e a preservação do capital contando com um portfólio diversificado e com elevada liquidez. O fundo fará operações em diversos mercados incluindo os mercados de renda fixa, renda variável e câmbio. Operações Shorts e DayTrade são permitidas.',          null,       'S' ,         'S' ,          'S',          'S',          '5000,00'      ,            '300,00'     ,      null          );
insert into TB_INVESTIMENTO (ID,PID_TIPO_INVESTIMENTO,PID_RISCO_PRE_FORMAT,PID_TIPO_RISCO,PID_PRODUTO,PID_EMPRESA,NM_INVESTIMENTO, CD_FUNDO_SEG,DS_RESUMO,FL_MAIOR_VENDA,FL_APORTE_OBRIG,FL_CONTRIB_OBRIG,FL_VISAO_CLIENTE,FL_ATIVO,VL_APORTE, VL_CONTRIBUICAO,COR)values(         608,          1,           null,          null,          6,         4,         'BOGARI VALUE ICATU PREV FIM',          'BOGAR',          'O BOGARI VALUE ICATU PREV FIM é um fundo de previdência multimercado gerido pela Bogari Capital que busca ter 70% de seu Patrimônio Líquido alocado em renda variável e o restante (30%) em renda fixa. O seu grande diferencial é a parcela de renda variável que busca replicar a mesma carteira do fundo aberto da gestora, cujo objetivo é prover aos clientes retornos consistentes no longo prazo através de investimento em ativos de elevado potencial de valorização. Investe em ações de empresas que estão sendo negociadas substancialmente abaixo de seu valor intrínseco.',          null,       'S' ,         'S' ,          'S',          'S',          '5000,00'      ,            '300,00'     ,      null          );
insert into TB_INVESTIMENTO (ID,PID_TIPO_INVESTIMENTO,PID_RISCO_PRE_FORMAT,PID_TIPO_RISCO,PID_PRODUTO,PID_EMPRESA,NM_INVESTIMENTO, CD_FUNDO_SEG,DS_RESUMO,FL_MAIOR_VENDA,FL_APORTE_OBRIG,FL_CONTRIB_OBRIG,FL_VISAO_CLIENTE,FL_ATIVO,VL_APORTE, VL_CONTRIBUICAO,COR)values(         23426,          1,           null,          null,          5,         4,         'INDIE ICATU PREVIDÊNCIA FIM',          'INDIE',          'Trata-se de um fundo previdenciário multimercado que pode investir até 70% de seu PL em ações. O processo de investimento foca em empresas brasileiras com assimetria de risco e retorno e evita riscos binários.',          null,       'S' ,         'S' ,          'S',          'S',          '5000,00'      ,            '300,00'     ,      null          );
insert into TB_INVESTIMENTO (ID,PID_TIPO_INVESTIMENTO,PID_RISCO_PRE_FORMAT,PID_TIPO_RISCO,PID_PRODUTO,PID_EMPRESA,NM_INVESTIMENTO, CD_FUNDO_SEG,DS_RESUMO,FL_MAIOR_VENDA,FL_APORTE_OBRIG,FL_CONTRIB_OBRIG,FL_VISAO_CLIENTE,FL_ATIVO,VL_APORTE, VL_CONTRIBUICAO,COR)values(         23424,          1,           null,          null,          5,         4,         'CONSTELLATION ICATU 70 PREV FIM',          'CON70',          'Fundo de previdência com gestão da Constellation Asset Management. Trata-se de um fundo previdenciário multimercado no qual 70% do seu PL é alocado na estratégia de renda variável da Constellation e o restante alocado em títulos de renda fixa. A filosofia de investimento da gestora baseia-se em estar próximo às empresas como um "friendly advisor", evitar a perda permanente de capital e concentrações indesejadas em certos fatores de risco e entender em detalhe as indústrias, os negócios, a gestão e a dinâmica particular de cada empresa que investe. A gestora procura manter um portfólio balanceado e suas posições ficam no portfólio em média 3 anos.',          null,       'S' ,         'S' ,          'S',          'S',          '5000,00'      ,            '300,00'     ,      null          );
