 INSERT INTO tb_fundo (    nm_fundo,    id,    vl_taf,    nu_cnpj,    cd_fundo_seg,    nm_fundo_reduzido,    dsc_performance,    logo,    ds_fundo,    ds_gestor,    nm_gestor,    vl_taxa_adm_maxima,    vl_taxa_adm_minima,    dsc_lmax_tx_performance,    fl_plano_qualificado,    ds_tipo_renda,    vl_carencia_inicial_resgate,    vl_carencia_ini_port_ext,    vl_carencia_ini_port_in,    vl_carencia_entre_resgate,    vl_carencia_entre_port_ext,    vl_atualizacao_contribuicao,    vl_atualizacao_beneficio,    vl_carregamento_entrada,    vl_carregamento_saida ) VALUES (        'IBIUNA PREV ICATU FIC FIM',     '517',        NULL     ,         '18041877000196'    ,         'IBIUN'  ,         'IBIUNA PREV ICATU FIC FIM'   ,         'Não há'    ,        'Ibiuna.png'    ,        'A Ibiuna Investimentos foi fundada em maio de 2010, com o objetivo de gerar retornos ao longo de longo prazo aos seus clientes. Possui sólida equipe de profissionais seniores, com larga experiência nos mercados local e internacional, liderada por Mário Torós, Rodrigo Azevedo e André Lion. O IBIUNA PREV ICATU FIC FIM é um fundo de previdência multimercado com enfoque macro “top down” que objetiva proporcionar aos seus cotistas ganhos de capital no longo prazo. O fundo busca oportunidades nos mercados de juros, moedas e renda variável. Foi um dos primeiros fundos de previdência multimercado, o fundo existe desde 2013.'      ,        'IBIUNA GESTAO DE RECURSOS LTDA.'    ,        'IBIUNA GESTAO DE RECURSOS LTDA.'    ,        '2,00'    ,        '2,00'    ,        '-'    ,        'N'    ,        'Renda Mensal Temporária 15 Anos'    ,        '60'    ,        '60'    ,        null    ,        '60'    ,        '60'    ,        'Anualmente pelo IPCA'    ,        'Anualmente pelo IPCA'    ,        null    ,        null         );
