 INSERT INTO tb_fundo (    nm_fundo,    id,    vl_taf,    nu_cnpj,    cd_fundo_seg,    nm_fundo_reduzido,    dsc_performance,    logo,    ds_fundo,    ds_gestor,    nm_gestor,    vl_taxa_adm_maxima,    vl_taxa_adm_minima,    dsc_lmax_tx_performance,    fl_plano_qualificado,    ds_tipo_renda,    vl_carencia_inicial_resgate,    vl_carencia_ini_port_ext,    vl_carencia_ini_port_in,    vl_carencia_entre_resgate,    vl_carencia_entre_port_ext,    vl_atualizacao_contribuicao,    vl_atualizacao_beneficio,    vl_carregamento_entrada,    vl_carregamento_saida ) VALUES (        'ICATU SEG INSIGNE FIC FI RF CP',     '591',        NULL     ,         '27825176000139'    ,         'INSIG'  ,         'ICATU SEG INSIGNE FIC FI RF CP'   ,         'Não há'    ,        'Vanguarda.jpg'    ,        'Fundo de previdência de crédito privado gerido pela Icatu Vanguarda. A casa se caracteriza pela gestão conservadora de crédito com longo histórico sem nenhum caso de default e por ter uma equipe experiente. A Vanguarda é focada na gestão, não distribui ou origina qualquer ativo de crédito, e realiza análise própria dos seus investimentos que conta com bureau de análise de crédito próprio atuante há mais de dez anos, que segue parâmetros de avaliação definidos pelo board da Icatu Seguros. A carteira do fundo se caracteriza por ter entre 50% e 80% em ativos de crédito privado de baixo risco e pela gestão ativa de RF na parcela de risco de mercado, porém com baixa volatilidade.'      ,        'ICATU VANGUARDA GESTÃO DE RECURSOS LTDA'    ,        'ICATU VANGUARDA GESTÃO DE RECURSOS LTDA'    ,        '0,80'    ,        '0,80'    ,        '-'    ,        'N'    ,        'Renda Mensal Temporária 15 Anos'    ,        '60'    ,        '60'    ,        null    ,        '60'    ,        '60'    ,        'Anualmente pelo IPCA'    ,        'Anualmente pelo IPCA'    ,        null    ,        null         );
