 INSERT INTO tb_fundo (    nm_fundo,    id,    vl_taf,    nu_cnpj,    cd_fundo_seg,    nm_fundo_reduzido,    dsc_performance,    logo,    ds_fundo,    ds_gestor,    nm_gestor,    vl_taxa_adm_maxima,    vl_taxa_adm_minima,    dsc_lmax_tx_performance,    fl_plano_qualificado,    ds_tipo_renda,    vl_carencia_inicial_resgate,    vl_carencia_ini_port_ext,    vl_carencia_ini_port_in,    vl_carencia_entre_resgate,    vl_carencia_entre_port_ext,    vl_atualizacao_contribuicao,    vl_atualizacao_beneficio,    vl_carregamento_entrada,    vl_carregamento_saida ) VALUES (        'APEX LONG BIASED ICATU PREV FIM 70',     '23422',        NULL     ,         '29732909000116'    ,         'APE70'  ,         'APEX LONG BIASED ICATU PREV FIM 70'   ,         '20% (vinte por cento) do que exceder a 100% (cem por cento) da variação do CDI'    ,        'logo_apex.png'    ,        'Fundo de previdência gerido pela Apex Capital. A estratégia consiste no conceito de que não é preciso que a totalidade do patrimônio de renda variável esteja em posição comprada para alcançar a valorização superior ao índice. O fundo se beneficia da queda dos preços das ações na parcela vendida e a diversificação entre as posições resulta em uma menor volatilidade. O PL restante do fundo é alocado em títulos públicos pós-fixados e indexados ao IPCA. Pode alocar até 70% de seu PL em renda variável.'      ,        'APEX CAPITAL LTDA'    ,        'APEX CAPITAL LTDA'    ,        '1,80'    ,        '0,52'    ,        '-'    ,        'N'    ,        'Renda Mensal Temporária 15 Anos'    ,        '60'    ,        '60'    ,        null    ,        '60'    ,        '60'    ,        'Anualmente pelo IPCA'    ,        'Anualmente pelo IPCA'    ,        null    ,        null         );
 INSERT INTO tb_fundo (    nm_fundo,    id,    vl_taf,    nu_cnpj,    cd_fundo_seg,    nm_fundo_reduzido,    dsc_performance,    logo,    ds_fundo,    ds_gestor,    nm_gestor,    vl_taxa_adm_maxima,    vl_taxa_adm_minima,    dsc_lmax_tx_performance,    fl_plano_qualificado,    ds_tipo_renda,    vl_carencia_inicial_resgate,    vl_carencia_ini_port_ext,    vl_carencia_ini_port_in,    vl_carencia_entre_resgate,    vl_carencia_entre_port_ext,    vl_atualizacao_contribuicao,    vl_atualizacao_beneficio,    vl_carregamento_entrada,    vl_carregamento_saida ) VALUES (        'ATHENA ICATU PREVIDENCIÁRIO FIM 70',     '612',        NULL     ,         '29045319000115'    ,         'ATH70'  ,         'ATHENA ICATU PREVIDENCIÁRIO FIM 70'   ,         '20% (vinte por cento) do que exceder a 100% (cem por cento) da variação do IPCA + IMA-B'    ,        'Athena.png'    ,        'Fundo de previdência multimercado gerido pela Athena Capital. O fundo investe basicamente em títulos públicos de baixo risco e renda variável. A parcela de renda variável adota como filosofia de investimento uma análise fundamentalista, amparada majoritariamente por análises e observações feitas diretamente na economia real. O fundo possui por objetivo proporcionar ganhos absolutos e consistentes a médio e longo prazo, sem perseguir correlação com qualquer índice de Bolsa. A parcela de renda variável do fundo fica predominantemente comprada em ações, mas pode, eventualmente, ter posições vendidas para ganho absoluto. Pode alocar até 70% de seu PL em renda variável.'      ,        'ATHENA CAPITAL GESTÃO DE RECURSOS LTDA'    ,        'ATHENA CAPITAL GESTÃO DE RECURSOS LTDA'    ,        '2,05'    ,        '1,97'    ,        '-'    ,        'N'    ,        'Renda Mensal Temporária 15 Anos'    ,        '60'    ,        '60'    ,        null    ,        '60'    ,        '60'    ,        'Anualmente pelo IPCA'    ,        'Anualmente pelo IPCA'    ,        null    ,        null         );
