 INSERT INTO tb_fundo (    nm_fundo,    id,    vl_taf,    nu_cnpj,    cd_fundo_seg,    nm_fundo_reduzido,    dsc_performance,    logo,    ds_fundo,    ds_gestor,    nm_gestor,    vl_taxa_adm_maxima,    vl_taxa_adm_minima,    dsc_lmax_tx_performance,    fl_plano_qualificado,    ds_tipo_renda,    vl_carencia_inicial_resgate,    vl_carencia_ini_port_ext,    vl_carencia_ini_port_in,    vl_carencia_entre_resgate,    vl_carencia_entre_port_ext,    vl_atualizacao_contribuicao,    vl_atualizacao_beneficio,    vl_carregamento_entrada,    vl_carregamento_saida ) VALUES (        'ICATU SEG DURATION FI RF',     '534',        NULL     ,         '04511286000120'    ,         'PGIGP'  ,         'ICATU SEG DURATION FI RF'   ,         'Não há'    ,        'Vanguarda.jpg'    ,        'É um fundo que compra basicamente títulos públicos e privados indexados à inflação. O fundo busca ter exposição tanto a IGP-M quanto IPCA. Apresenta volatilidade elevada apesar de ser de renda fixa. Essa característica deve-se a necessidade de marcar a mercado os títulos que compõem a carteira do fundo, isto é, os papéis devem ter o seu valor de venda atualizados diariamente mesmo que sejam carregados até o vencimento. As NTN-Bs por possuírem um caráter pré-fixado apresentam variação no seu preço unitário conforme alterações nas expectativas de juros futuras, de maneira geral, se há expectativa de subida nas taxas de juros os preços dos títulos caem e se há expectativa de queda nas taxas de juros os preços sobem.'      ,        'ICATU VANGUARDA GESTÃO DE RECURSOS LTDA'    ,        'ICATU VANGUARDA GESTÃO DE RECURSOS LTDA'    ,        '1,50'    ,        '1,50'    ,        '-'    ,        'N'    ,        'Renda Mensal Temporária 15 Anos'    ,        '60'    ,        '60'    ,        null    ,        '60'    ,        '60'    ,        'Anualmente pelo IPCA'    ,        'Anualmente pelo IPCA'    ,        null    ,        null         );
