 INSERT INTO tb_fundo (    nm_fundo,    id,    vl_taf,    nu_cnpj,    cd_fundo_seg,    nm_fundo_reduzido,    dsc_performance,    logo,    ds_fundo,    ds_gestor,    nm_gestor,    vl_taxa_adm_maxima,    vl_taxa_adm_minima,    dsc_lmax_tx_performance,    fl_plano_qualificado,    ds_tipo_renda,    vl_carencia_inicial_resgate,    vl_carencia_ini_port_ext,    vl_carencia_ini_port_in,    vl_carencia_entre_resgate,    vl_carencia_entre_port_ext,    vl_atualizacao_contribuicao,    vl_atualizacao_beneficio,    vl_carregamento_entrada,    vl_carregamento_saida ) VALUES (        'ICATU SEG GLOBAL EQUITY INCOME 10 FI MUL',     '589',        NULL     ,         '28557951000185'    ,         'GLOBA'  ,         'ICATU SEG GLOBAL EQUITY INCOME 10 FI MUL'   ,         'Não há'    ,        'Vanguarda.jpg'    ,        'O fundo nasceu da parceria entre a Icatu Seguros e BlackRock. O fundo investe em uma carteira diversificada composta por títulos atrelados à inflação com vencimento inferior a 5 anos e de ações globais de alta qualidade (até 10% do PL). A gestão do fundo fica a cargo da Icatu Vanguarda que faz a alocação da parte de renda fixa brasileira e investe, via veículos locais, em uma estratégia de ações globais da BlackRock. A diversificação é o grande diferencial do produto, a estratégia gerida pela BlackRock oferece uma diversificação geográfica e setorial muito mais ampla que o investimento em renda variável local. Além disso, a alocação em ativos atrelados a índice de preços proporciona ganho real e proteção contra a inflação. Fatores que tornam o fundo atrativo para investimento de longo prazo.'      ,        'ICATU VANGUARDA GESTÃO DE RECURSOS LTDA'    ,        'ICATU VANGUARDA GESTÃO DE RECURSOS LTDA'    ,        '1,10'    ,        '1,00'    ,        '-'    ,        'N'    ,        'Renda Mensal Temporária 15 Anos'    ,        '60'    ,        '60'    ,        null    ,        '60'    ,        '60'    ,        'Anualmente pelo IPCA'    ,        'Anualmente pelo IPCA'    ,        null    ,        null         );
