 INSERT INTO tb_fundo (    nm_fundo,    id,    vl_taf,    nu_cnpj,    cd_fundo_seg,    nm_fundo_reduzido,    dsc_performance,    logo,    ds_fundo,    ds_gestor,    nm_gestor,    vl_taxa_adm_maxima,    vl_taxa_adm_minima,    dsc_lmax_tx_performance,    fl_plano_qualificado,    ds_tipo_renda,    vl_carencia_inicial_resgate,    vl_carencia_ini_port_ext,    vl_carencia_ini_port_in,    vl_carencia_entre_resgate,    vl_carencia_entre_port_ext,    vl_atualizacao_contribuicao,    vl_atualizacao_beneficio,    vl_carregamento_entrada,    vl_carregamento_saida ) VALUES (        'WESTERN ASSET ICATU RF ATIVO PREV FIC FI',     '557',        NULL     ,         '23872787000187'    ,         'WEPRE'  ,         'WESTERN ASSET ICATU RF ATIVO PREV FIC FI'   ,         'Não há'    ,        'WESTERN ASSET.png'    ,        'Fundo de renda fixa com gestão da Western Asset. O fundo tem por objetivo proporcionar rentabilidade através das oportunidades oferecidas pelos mercados domésticos de taxa de juros pré-fixadas, taxas de juros de um dia praticadas no mercado interbancário e índices de preço, excluindo estratégias que impliquem risco de moeda estrangeira ou de renda variável. Para a realização do objetivo do Fundo, o gestor buscará primordialmente aumentar ou diminuir, conforme o caso, a exposição do Fundo ao mercado de taxas de juros, procurando, conforme o caso, obter ganhos adicionais ou limitar perdas para a carteira.'      ,        'WESTERN ASSET MANAGEMENT COMPANY DTVM LIMITADA'    ,        'WESTERN ASSET MANAGEMENT COMPANY DTVM LIMITADA'    ,        '0,80'    ,        '0,80'    ,        '-'    ,        'N'    ,        'Renda Mensal Temporária 15 Anos'    ,        '60'    ,        '60'    ,        null    ,        '60'    ,        '60'    ,        'Anualmente pelo IPCA'    ,        'Anualmente pelo IPCA'    ,        null    ,        null         );
 INSERT INTO tb_fundo (    nm_fundo,    id,    vl_taf,    nu_cnpj,    cd_fundo_seg,    nm_fundo_reduzido,    dsc_performance,    logo,    ds_fundo,    ds_gestor,    nm_gestor,    vl_taxa_adm_maxima,    vl_taxa_adm_minima,    dsc_lmax_tx_performance,    fl_plano_qualificado,    ds_tipo_renda,    vl_carencia_inicial_resgate,    vl_carencia_ini_port_ext,    vl_carencia_ini_port_in,    vl_carencia_entre_resgate,    vl_carencia_entre_port_ext,    vl_atualizacao_contribuicao,    vl_atualizacao_beneficio,    vl_carregamento_entrada,    vl_carregamento_saida ) VALUES (        'VINCI EQUILÍBRIO ICATU PREV FIC FIM II',     '551',        NULL     ,         '23964741000198'    ,         'VIN2'  ,         'VINCI EQUILÍBRIO ICATU PREV FIC FIM II'   ,         'Não há'    ,        'Vinci.png'    ,        'Fundo multimercado gerido pela Vinci. O fundo aloca recursos nas seguintes estratégias: renda fixa – pós-fixado, renda fixa – inflação curta e renda variável – dividendos. A gestora possui bom histórico na estratégia de dividendos cujo objetivo é realizar investimentos em empresas de bons retornos de longo prazo e com baixa volatilidade. Tais empresas, em geral, são maduras, com baixo risco de negócio, baixo risco de projeção, geram lucros e têm baixa necessidade de re-investimento. Além disso, possuem sustentável geração de caixa e de distribuição de resultados e também possuem boa proteção contra inflação.'      ,        'VINCI GESTÃO DE PATRIMÔNIO LTDA'    ,        'VINCI GESTÃO DE PATRIMÔNIO LTDA'    ,        '2,00'    ,        '2,00'    ,        '-'    ,        'N'    ,        'Renda Mensal Temporária 15 Anos'    ,        '60'    ,        '60'    ,        null    ,        '60'    ,        '60'    ,        'Anualmente pelo IPCA'    ,        'Anualmente pelo IPCA'    ,        null    ,        null         );
 INSERT INTO tb_fundo (    nm_fundo,    id,    vl_taf,    nu_cnpj,    cd_fundo_seg,    nm_fundo_reduzido,    dsc_performance,    logo,    ds_fundo,    ds_gestor,    nm_gestor,    vl_taxa_adm_maxima,    vl_taxa_adm_minima,    dsc_lmax_tx_performance,    fl_plano_qualificado,    ds_tipo_renda,    vl_carencia_inicial_resgate,    vl_carencia_ini_port_ext,    vl_carencia_ini_port_in,    vl_carencia_entre_resgate,    vl_carencia_entre_port_ext,    vl_atualizacao_contribuicao,    vl_atualizacao_beneficio,    vl_carregamento_entrada,    vl_carregamento_saida ) VALUES (        'ICATU SEG INSIGNE FIC FI RF CP',     '535',        NULL     ,         '27825176000139'    ,         'INSIG'  ,         'ICATU SEG INSIGNE FIC FI RF CP'   ,         'Não há'    ,        'Vanguarda.jpg'    ,        'Fundo de previdência de crédito privado gerido pela Icatu Vanguarda. A casa se caracteriza pela gestão conservadora de crédito com longo histórico sem nenhum caso de default e por ter uma equipe experiente. A Vanguarda é focada na gestão, não distribui ou origina qualquer ativo de crédito, e realiza análise própria dos seus investimentos que conta com bureau de análise de crédito próprio atuante há mais de dez anos, que segue parâmetros de avaliação definidos pelo board da Icatu Seguros. A carteira do fundo se caracteriza por ter entre 50% e 80% em ativos de crédito privado de baixo risco e pela gestão ativa de RF na parcela de risco de mercado, porém com baixa volatilidade.'      ,        'ICATU VANGUARDA GESTÃO DE RECURSOS LTDA'    ,        'ICATU VANGUARDA GESTÃO DE RECURSOS LTDA'    ,        '0,80'    ,        '0,80'    ,        '-'    ,        'N'    ,        'Renda Mensal Temporária 15 Anos'    ,        '60'    ,        '60'    ,        null    ,        '60'    ,        '60'    ,        'Anualmente pelo IPCA'    ,        'Anualmente pelo IPCA'    ,        null    ,        null         );
 INSERT INTO tb_fundo (    nm_fundo,    id,    vl_taf,    nu_cnpj,    cd_fundo_seg,    nm_fundo_reduzido,    dsc_performance,    logo,    ds_fundo,    ds_gestor,    nm_gestor,    vl_taxa_adm_maxima,    vl_taxa_adm_minima,    dsc_lmax_tx_performance,    fl_plano_qualificado,    ds_tipo_renda,    vl_carencia_inicial_resgate,    vl_carencia_ini_port_ext,    vl_carencia_ini_port_in,    vl_carencia_entre_resgate,    vl_carencia_entre_port_ext,    vl_atualizacao_contribuicao,    vl_atualizacao_beneficio,    vl_carregamento_entrada,    vl_carregamento_saida ) VALUES (        'TRUXT MACRO PREV ICATU FIC FIM',     '23434',        NULL     ,         '29733120000180'    ,         'TRUXT'  ,         'TRUXT MACRO PREV ICATU FIC FIM'   ,         'Não há'    ,        'TRUXT.jpg'    ,        'Fundo de previdência com gestão da Truxt Investimentos. Trata-se de um fundo previdenciário multimercado com estratégia macro que busca replicar a mesma carteira do fundo TRUXT MACRO respeitando as restrições legais da regulação de previdência. A estratégia macro alia a análise fundamentalista, considerando os cenários macroeconômico de médio e longo prazo e identificação de tendências dos ciclos econômicos, com a visão oportunistíca e o monitoramento constante do risco. O fundo tem por objetivo a geração de retorno no longo prazo e a preservação do capital do participante a partir de uma carteira com flexibilidade da alocação de risco total, entre os diversos mercados e estratégias.'      ,        'TRUXT INVESTIMENTOS LTDA.'    ,        'TRUXT INVESTIMENTOS LTDA.'    ,        '2,05'    ,        '1,97'    ,        '-'    ,        'N'    ,        'Renda Mensal Temporária 15 Anos'    ,        '60'    ,        '60'    ,        null    ,        '60'    ,        '60'    ,        'Anualmente pelo IPCA'    ,        'Anualmente pelo IPCA'    ,        null    ,        null         );
