 INSERT INTO tb_fundo (    nm_fundo,    id,    vl_taf,    nu_cnpj,    cd_fundo_seg,    nm_fundo_reduzido,    dsc_performance,    logo,    ds_fundo,    ds_gestor,    nm_gestor,    vl_taxa_adm_maxima,    vl_taxa_adm_minima,    dsc_lmax_tx_performance,    fl_plano_qualificado,    ds_tipo_renda,    vl_carencia_inicial_resgate,    vl_carencia_ini_port_ext,    vl_carencia_ini_port_in,    vl_carencia_entre_resgate,    vl_carencia_entre_port_ext,    vl_atualizacao_contribuicao,    vl_atualizacao_beneficio,    vl_carregamento_entrada,    vl_carregamento_saida ) VALUES (        'ICATU SEG CLASSIC DIVIDENDOS 20 FIC FIM',     '521',        NULL     ,         '04223314000104'    ,         'SBC20'  ,         'ICATU SEG CLASSIC DIVIDENDOS 20 FIC FIM'   ,         'Não há'    ,        'Vanguarda.jpg'    ,        'Fundo de previdência balanceado gerido pela Icatu Vanguarda. O fundo balanceado é um tipo particular de multimercado que investe somente em renda variável e renda fixa em uma proporção definida. O fundo se caracteriza por ter a sua parcela de renda variável buscando superar consistentemente e com menos risco o Ibovespa investindo em ações de empresas que tenham boa gestão e governança, business estável e com previsibilidade de resultados, proteção contra inflação, valuation atrativo com perspectiva de crescimento e que distribuam dividendos, juros sobre capital próprio e outros proventos. Outra característica desses fundos é que a sua parcela de renda fixa adota a estratégia de investimento de inflação curta, que compra títulos públicos e privados indexados à inflação com vencimentos inferiores a 5 anos. Pode aplicar até 20% em renda variável.'      ,        'ICATU VANGUARDA GESTÃO DE RECURSOS LTDA'    ,        'ICATU VANGUARDA GESTÃO DE RECURSOS LTDA'    ,        '1,50'    ,        '1,50'    ,        '-'    ,        'N'    ,        'Renda Mensal Temporária 15 Anos'    ,        '60'    ,        '60'    ,        null    ,        '60'    ,        '60'    ,        'Anualmente pelo IPCA'    ,        'Anualmente pelo IPCA'    ,        null    ,        null         );
 INSERT INTO tb_fundo (    nm_fundo,    id,    vl_taf,    nu_cnpj,    cd_fundo_seg,    nm_fundo_reduzido,    dsc_performance,    logo,    ds_fundo,    ds_gestor,    nm_gestor,    vl_taxa_adm_maxima,    vl_taxa_adm_minima,    dsc_lmax_tx_performance,    fl_plano_qualificado,    ds_tipo_renda,    vl_carencia_inicial_resgate,    vl_carencia_ini_port_ext,    vl_carencia_ini_port_in,    vl_carencia_entre_resgate,    vl_carencia_entre_port_ext,    vl_atualizacao_contribuicao,    vl_atualizacao_beneficio,    vl_carregamento_entrada,    vl_carregamento_saida ) VALUES (        'ICATU SEG FIC FI RF INFLAÇÃO LONGA',     '587',        NULL     ,         '04228716000100'    ,         'NW6'  ,         'ICATU SEG FIC FI RF INFLAÇÃO LONGA'   ,         'Não há'    ,        'Vanguarda.jpg'    ,        'É um fundo que compra basicamente títulos públicos e privados indexados à inflação com vencimentos superiores a 5 anos. A carteira do fundo busca replicar a composição do IMA-B 5+ tendo duration e yield próximos ao índice. Apresenta volatilidade elevada apesar de ser de renda fixa. Essa característica deve-se a necessidade de marcar a mercado os títulos que compõem a carteira do fundo, isto é, os papéis devem ter o seu valor de venda atualizados diariamente mesmo que sejam carregados até o vencimento. As NTN-Bs por possuírem um caráter pré-fixado apresentam variação no seu valor de mercado conforme alterações nas expectativas de juros futuras, de maneira geral, se há expectativa de subida nas taxas de juros os preços dos títulos caem e se há expectativa de queda nas taxas de juros os preços sobem.'      ,        'ICATU VANGUARDA GESTÃO DE RECURSOS LTDA'    ,        'ICATU VANGUARDA GESTÃO DE RECURSOS LTDA'    ,        '1,50'    ,        '1,50'    ,        '-'    ,        'N'    ,        'Renda Mensal Temporária 15 Anos'    ,        '60'    ,        '60'    ,        null    ,        '60'    ,        '60'    ,        'Anualmente pelo IPCA'    ,        'Anualmente pelo IPCA'    ,        n