 INSERT INTO tb_fundo (    nm_fundo,    id,    vl_taf,    nu_cnpj,    cd_fundo_seg,    nm_fundo_reduzido,    dsc_performance,    logo,    ds_fundo,    ds_gestor,    nm_gestor,    vl_taxa_adm_maxima,    vl_taxa_adm_minima,    dsc_lmax_tx_performance,    fl_plano_qualificado,    ds_tipo_renda,    vl_carencia_inicial_resgate,    vl_carencia_ini_port_ext,    vl_carencia_ini_port_in,    vl_carencia_entre_resgate,    vl_carencia_entre_port_ext,    vl_atualizacao_contribuicao,    vl_atualizacao_beneficio,    vl_carregamento_entrada,    vl_carregamento_saida ) VALUES (        'IBIUNA PREV ICATU FIC FIM',     '573',        NULL     ,         '18041877000196'    ,         'IBIUN'  ,         'IBIUNA PREV ICATU FIC FIM'   ,         'Não há'    ,        'Ibiuna.png'    ,        'A Ibiuna Investimentos foi fundada em maio de 2010, com o objetivo de gerar retornos ao longo de longo prazo aos seus clientes. Possui sólida equipe de profissionais seniores, com larga experiência nos mercados local e internacional, liderada por Mário Torós, Rodrigo Azevedo e André Lion. O IBIUNA PREV ICATU FIC FIM é um fundo de previdência multimercado com enfoque macro “top down” que objetiva proporcionar aos seus cotistas ganhos de capital no longo prazo. O fundo busca oportunidades nos mercados de juros, moedas e renda variável. Foi um dos primeiros fundos de previdência multimercado, o fundo existe desde 2013.'      ,        'IBIUNA GESTAO DE RECURSOS LTDA.'    ,        'IBIUNA GESTAO DE RECURSOS LTDA.'    ,        '2,00'    ,        '2,00'    ,        '-'    ,        'N'    ,        'Renda Mensal Temporária 15 Anos'    ,        '60'    ,        '60'    ,        null    ,        '60'    ,        '60'    ,        'Anualmente pelo IPCA'    ,        'Anualmente pelo IPCA'    ,        null    ,        null         );
 INSERT INTO tb_fundo (    nm_fundo,    id,    vl_taf,    nu_cnpj,    cd_fundo_seg,    nm_fundo_reduzido,    dsc_performance,    logo,    ds_fundo,    ds_gestor,    nm_gestor,    vl_taxa_adm_maxima,    vl_taxa_adm_minima,    dsc_lmax_tx_performance,    fl_plano_qualificado,    ds_tipo_renda,    vl_carencia_inicial_resgate,    vl_carencia_ini_port_ext,    vl_carencia_ini_port_in,    vl_carencia_entre_resgate,    vl_carencia_entre_port_ext,    vl_atualizacao_contribuicao,    vl_atualizacao_beneficio,    vl_carregamento_entrada,    vl_carregamento_saida ) VALUES (        'APEX LONG BIASED ICATU PREVFIM 49',     '560',        NULL     ,         '20814969000103'    ,         'APEXM'  ,         'APEX LONG BIASED ICATU PREVFIM 49'   ,         'Não há'    ,        'logo_apex.png'    ,        'Fundo de previdência gerido pela Apex Capital. O APEX LONG BIASED ICATU PREV FIM 49 foi o primeiro fundo de previdência com estratégia de investimento Long Biased. A estratégia consiste no conceito de que não é preciso que a totalidade do patrimônio de renda variável esteja em posição comprada para alcançar a valorização superior ao índice. O fundo se beneficia da queda dos preços das ações na parcela vendida e a diversificação entre as posições resulta em uma menor volatilidade. O PL restante do fundo é alocado em títulos públicos pós-fixados e indexados ao IPCA. Pode alocar até 49% de seu PL em renda variável.'      ,        'APEX CAPITAL LTDA'    ,        'APEX CAPITAL LTDA'    ,        '2,00'    ,        '1,10'    ,        '-'    ,        'N'    ,        'Renda Mensal Temporária 15 Anos'    ,        '60'    ,        '60'    ,        null    ,        '60'    ,        '60'    ,        'Anualmente pelo IPCA'    ,        'Anualmente pelo IPCA'    ,        null    ,        null         );
 INSERT INTO tb_fundo (    nm_fundo,    id,    vl_taf,    nu_cnpj,    cd_fundo_seg,    nm_fundo_reduzido,    dsc_performance,    logo,    ds_fundo,    ds_gestor,    nm_gestor,    vl_taxa_adm_maxima,    vl_taxa_adm_minima,    dsc_lmax_tx_performance,    fl_plano_qualificado,    ds_tipo_renda,    vl_carencia_inicial_resgate,    vl_carencia_ini_port_ext,    vl_carencia_ini_port_in,    vl_carencia_entre_resgate,    vl_carencia_entre_port_ext,    vl_atualizacao_contribuicao,    vl_atualizacao_beneficio,    vl_carregamento_entrada,    vl_carregamento_saida ) VALUES (        'ADAM ICATU PREVIDENCIÁRIO FIC FIM',     '559',        NULL     ,         '25681955000182'    ,         'C1741'  ,         'ADAM ICATU PREVIDENCIÁRIO FIC FIM'   ,         'Não há'    ,        'Adam.png'    ,        'Fundo de previdência multimercado gerido pela Adam Capital. O objetivo do fundo é a geração de retorno em diversos mercados e classes de ativos (juros, moedas e índice de bolsas), sem preferência por tipo de ativo e independente de direções específicas de movimento, buscando rentabilidade acima do Certificado de Depósito Interbancário - CDI. Márcio Appel, sócio responsável pela Gestão, possui 20 anos de experiência no mercado financeiro, obtendo resultados de sucesso em diversos cenários e mercados. A gestora atingiu mais de R$ 5 bilhões de ativos sobre gestão em menos de 6 meses e o fundo de previdência da estratégia atingiu PL superior a R$ 1 bilhão em menos de 1 ano e meio.'      ,        'ADAMCAPITAL GESTÃO DE RECURSOS LTDA.'    ,        'ADAMCAPITAL GESTÃO DE RECURSOS LTDA.'    ,        '2,00'    ,        '2,00'    ,        '-'    ,        'N'    ,        'Renda Mensal Temporária 15 Anos'    ,        '60'    ,        '60'    ,        null    ,        '60'    ,        '60'    ,        'Anualmente pelo IPCA'    ,        'Anualmente pelo IPCA'    ,        null    ,        null         );
