 INSERT INTO tb_fundo (    nm_fundo,    id,    vl_taf,    nu_cnpj,    cd_fundo_seg,    nm_fundo_reduzido,    dsc_performance,    logo,    ds_fundo,    ds_gestor,    nm_gestor,    vl_taxa_adm_maxima,    vl_taxa_adm_minima,    dsc_lmax_tx_performance,    fl_plano_qualificado,    ds_tipo_renda,    vl_carencia_inicial_resgate,    vl_carencia_ini_port_ext,    vl_carencia_ini_port_in,    vl_carencia_entre_resgate,    vl_carencia_entre_port_ext,    vl_atualizacao_contribuicao,    vl_atualizacao_beneficio,    vl_carregamento_entrada,    vl_carregamento_saida ) VALUES (        'ATHENA ICATU PREV FIM 49',     '507',        NULL     ,         '26680218000128'    ,         'ATENA'  ,         'ATHENA ICATU PREV FIM 49'   ,         'Não há'    ,        'Athena.png'    ,        'Fundo de previdência multimercado gerido pela Athena Capital. O fundo investe basicamente em títulos públicos de baixo risco e renda variável. A parcela de renda variável adota como filosofia de investimento uma análise fundamentalista, amparada majoritariamente por análises e observações feitas diretamente na economia real. O fundo possui por objetivo proporcionar ganhos absolutos e consistentes a médio e longo prazo, sem perseguir correlação com qualquer índice de Bolsa. A parcela de renda variável do fundo fica predominantemente comprada em ações, mas pode, eventualmente, ter posições vendidas para ganho absoluto. Pode alocar até 49% de seu PL em renda variável.'      ,        'ATHENA CAPITAL GESTÃO DE RECURSOS LTDA'    ,        'ATHENA CAPITAL GESTÃO DE RECURSOS LTDA'    ,        '2,00'    ,        '1,10'    ,        '-'    ,        'N'    ,        'Renda Mensal Temporária 15 Anos'    ,        '60'    ,        '60'    ,        null    ,        '60'    ,        '60'    ,        'Anualmente pelo IPCA'    ,        'Anualmente pelo IPCA'    ,        null    ,        null         );
