 INSERT INTO tb_fundo (    nm_fundo,    id,    vl_taf,    nu_cnpj,    cd_fundo_seg,    nm_fundo_reduzido,    dsc_performance,    logo,    ds_fundo,    ds_gestor,    nm_gestor,    vl_taxa_adm_maxima,    vl_taxa_adm_minima,    dsc_lmax_tx_performance,    fl_plano_qualificado,    ds_tipo_renda,    vl_carencia_inicial_resgate,    vl_carencia_ini_port_ext,    vl_carencia_ini_port_in,    vl_carencia_entre_resgate,    vl_carencia_entre_port_ext,    vl_atualizacao_contribuicao,    vl_atualizacao_beneficio,    vl_carregamento_entrada,    vl_carregamento_saida ) VALUES (        'ICATU SEG TESOURO JURO REAL 2024 FICFIRF',     '600',        NULL     ,         '28320997000186'    ,         'JR024'  ,         'ICATU SEG TESOURO JURO REAL 2024 FICFIRF'   ,         'Não há'    ,        'Vanguarda.jpg'    ,        'O Tesouro IPCA+ (NTN-B 2024) é um título pós-fixado, cuja rentabilidade é composta por uma taxa anual (Yield) pactuada no momento da compra mais a variação do IPCA (Índice de Preços ao Consumidor Amplo), índice de inflação oficial do governo brasileiro. O fundo visa replicar a rentabilidade da NTN-B 2024 (menos os custos do fundo), proporcionando rentabilidade real, ou seja, preservando o aumento de poder de compra do seu dinheiro. Esse investimento se destina a investidores com investimentos com vencimentos em torno de 2024 e que tolerem oscilação de cotas em janelas mais curtas.'      ,        'ICATU VANGUARDA GESTÃO DE RECURSOS LTDA'    ,        'ICATU VANGUARDA GESTÃO DE RECURSOS LTDA'    ,        '0,75'    ,        '0,75'    ,        '-'    ,        'N'    ,        'Renda Mensal Temporária 15 Anos'    ,        '60'    ,        '60'    ,        null    ,        '60'    ,        '60'    ,        'Anualmente pelo IPCA'    ,        'Anualmente pelo IPCA'    ,        null    ,        null         );
 INSERT INTO tb_fundo (    nm_fundo,    id,    vl_taf,    nu_cnpj,    cd_fundo_seg,    nm_fundo_reduzido,    dsc_performance,    logo,    ds_fundo,    ds_gestor,    nm_gestor,    vl_taxa_adm_maxima,    vl_taxa_adm_minima,    dsc_lmax_tx_performance,    fl_plano_qualificado,    ds_tipo_renda,    vl_carencia_inicial_resgate,    vl_carencia_ini_port_ext,    vl_carencia_ini_port_in,    vl_carencia_entre_resgate,    vl_carencia_entre_port_ext,    vl_atualizacao_contribuicao,    vl_atualizacao_beneficio,    vl_carregamento_entrada,    vl_carregamento_saida ) VALUES (        'ICATU SEG MACRO FIM PREV',     '23429',        NULL     ,         '28557920000124'    ,         'MACRO'  ,         'ICATU SEG MACRO FIM PREV'   ,         'Não há'    ,        'Vanguarda.jpg'    ,        'O fundo Icatu Seg Macro Prev é um fundo multimercado que terá gestão compartilhada entre as equipes de multiestratégia e de renda variável da Icatu Vanguarda. As decisões de investimento do fundo são tomadas em conjunto pelos gestores/traders responsáveis por cada uma das áreas a partir de análise macro fundamentada em modelos próprios. O objetivo do fundo é oferecer retornos consistentes no longo prazo e a preservação do capital contando com um portfólio diversificado e com elevada liquidez. O fundo fará operações em diversos mercados incluindo os mercados de renda fixa, renda variável e câmbio. Operações Shorts e DayTrade são permitidas.'      ,        'ICATU VANGUARDA GESTÃO DE RECURSOS LTDA'    ,        'ICATU VANGUARDA GESTÃO DE RECURSOS LTDA'    ,        '1,80'    ,        '0,95'    ,        '-'    ,        'N'    ,        'Renda Mensal Temporária 15 Anos'    ,        '60'    ,        '60'    ,        null    ,        '60'    ,        '60'    ,        'Anualmente pelo IPCA'    ,        'Anualmente pelo IPCA'    ,        null    ,        null         );
 INSERT INTO tb_fundo (    nm_fundo,    id,    vl_taf,    nu_cnpj,    cd_fundo_seg,    nm_fundo_reduzido,    dsc_performance,    logo,    ds_fundo,    ds_gestor,    nm_gestor,    vl_taxa_adm_maxima,    vl_taxa_adm_minima,    dsc_lmax_tx_performance,    fl_plano_qualificado,    ds_tipo_renda,    vl_carencia_inicial_resgate,    vl_carencia_ini_port_ext,    vl_carencia_ini_port_in,    vl_carencia_entre_resgate,    vl_carencia_entre_port_ext,    vl_atualizacao_contribuicao,    vl_atualizacao_beneficio,    vl_carregamento_entrada,    vl_carregamento_saida ) VALUES (        'CONSTELLATION ICATU 70 PREV FIM',     '23424',        NULL     ,         '30178912000119'    ,         'CON70'  ,         'CONSTELLATION ICATU 70 PREV FIM'   ,         '20% (vinte por cento) do que exceder a 100% (cem por cento) da variação do CDI'    ,        'TRUXT.jpg'    ,        'Fundo de previdência com gestão da Constellation Asset Management. Trata-se de um fundo previdenciário multimercado no qual 70% do seu PL é alocado na estratégia de renda variável da Constellation e o restante alocado em títulos de renda fixa. A filosofia de investimento da gestora baseia-se em estar próximo às empresas como um "friendly advisor", evitar a perda permanente de capital e concentrações indesejadas em certos fatores de risco e entender em detalhe as indústrias, os negócios, a gestão e a dinâmica particular de cada empresa que investe. A gestora procura manter um portfólio balanceado e suas posições ficam no portfólio em média 3 anos.'      ,        'CONSTELLATION INVESTIMENTOS E PARTICIPAÇÕES LTDA'    ,        'CONSTELLATION INVESTIMENTOS E PARTICIPAÇÕES LTDA'    ,        '1,80'    ,        '1,80'    ,        '-'    ,        'N'    ,        'Renda Mensal Temporária 15 Anos'    ,        '60'    ,        '60'    ,        null    ,        '60'    ,        '60'    ,        'Anualmente pelo IPCA'    ,        'Anualmente pelo IPCA'    ,        null    ,        null         );
