 INSERT INTO tb_fundo (    nm_fundo,    id,    vl_taf,    nu_cnpj,    cd_fundo_seg,    nm_fundo_reduzido,    dsc_performance,    logo,    ds_fundo,    ds_gestor,    nm_gestor,    vl_taxa_adm_maxima,    vl_taxa_adm_minima,    dsc_lmax_tx_performance,    fl_plano_qualificado,    ds_tipo_renda,    vl_carencia_inicial_resgate,    vl_carencia_ini_port_ext,    vl_carencia_ini_port_in,    vl_carencia_entre_resgate,    vl_carencia_entre_port_ext,    vl_atualizacao_contribuicao,    vl_atualizacao_beneficio,    vl_carregamento_entrada,    vl_carregamento_saida ) VALUES (        'ATHENA ICATU PREVIDENCIÁRIO FIM 70',     '556',        NULL     ,         '29045319000115'    ,         'ATH70'  ,         'ATHENA ICATU PREVIDENCIÁRIO FIM 70'   ,         '20% (vinte por cento) do que exceder a 100% (cem por cento) da variação do IPCA + IMA-B'    ,        'Athena.png'    ,        'Fundo de previdência multimercado gerido pela Athena Capital. O fundo investe basicamente em títulos públicos de baixo risco e renda variável. A parcela de renda variável adota como filosofia de investimento uma análise fundamentalista, amparada majoritariamente por análises e observações feitas diretamente na economia real. O fundo possui por objetivo proporcionar ganhos absolutos e consistentes a médio e longo prazo, sem perseguir correlação com qualquer índice de Bolsa. A parcela de renda variável do fundo fica predominantemente comprada em ações, mas pode, eventualmente, ter posições vendidas para ganho absoluto. Pode alocar até 70% de seu PL em renda variável.'      ,        'ATHENA CAPITAL GESTÃO DE RECURSOS LTDA'    ,        'ATHENA CAPITAL GESTÃO DE RECURSOS LTDA'    ,        '2,05'    ,        '1,97'    ,        '-'    ,        'N'    ,        'Renda Mensal Temporária 15 Anos'    ,        '60'    ,        '60'    ,        null    ,        '60'    ,        '60'    ,        'Anualmente pelo IPCA'    ,        'Anualmente pelo IPCA'    ,        null    ,        null         );
 INSERT INTO tb_fundo (    nm_fundo,    id,    vl_taf,    nu_cnpj,    cd_fundo_seg,    nm_fundo_reduzido,    dsc_performance,    logo,    ds_fundo,    ds_gestor,    nm_gestor,    vl_taxa_adm_maxima,    vl_taxa_adm_minima,    dsc_lmax_tx_performance,    fl_plano_qualificado,    ds_tipo_renda,    vl_carencia_inicial_resgate,    vl_carencia_ini_port_ext,    vl_carencia_ini_port_in,    vl_carencia_entre_resgate,    vl_carencia_entre_port_ext,    vl_atualizacao_contribuicao,    vl_atualizacao_beneficio,    vl_carregamento_entrada,    vl_carregamento_saida ) VALUES (        'ICATU SEG FIC FI RF INFLAÇÃO LONGA',     '531',        NULL     ,         '04228716000100'    ,         'NW6'  ,         'ICATU SEG FIC FI RF INFLAÇÃO LONGA'   ,         'Não há'    ,        'Vanguarda.jpg'    ,        'É um fundo que compra basicamente títulos públicos e privados indexados à inflação com vencimentos superiores a 5 anos. A carteira do fundo busca replicar a composição do IMA-B 5+ tendo duration e yield próximos ao índice. Apresenta volatilidade elevada apesar de ser de renda fixa. Essa característica deve-se a necessidade de marcar a mercado os títulos que compõem a carteira do fundo, isto é, os papéis devem ter o seu valor de venda atualizados diariamente mesmo que sejam carregados até o vencimento. As NTN-Bs por possuírem um caráter pré-fixado apresentam variação no seu valor de mercado conforme alterações nas expectativas de juros futuras, de maneira geral, se há expectativa de subida nas taxas de juros os preços dos títulos caem e se há expectativa de queda nas taxas de juros os preços sobem.'      ,        'ICATU VANGUARDA GESTÃO DE RECURSOS LTDA'    ,        'ICATU VANGUARDA GESTÃO DE RECURSOS LTDA'    ,        '1,50'    ,        '1,50'    ,        '-'    ,        'N'    ,        'Renda Mensal Temporária 15 Anos'    ,        '60'    ,        '60'    ,        null    ,        '60'    ,        '60'    ,        'Anualmente pelo IPCA'    ,        'Anualmente pelo IPCA'    ,        null    ,        null         );
 INSERT INTO tb_fundo (    nm_fundo,    id,    vl_taf,    nu_cnpj,    cd_fundo_seg,    nm_fundo_reduzido,    dsc_performance,    logo,    ds_fundo,    ds_gestor,    nm_gestor,    vl_taxa_adm_maxima,    vl_taxa_adm_minima,    dsc_lmax_tx_performance,    fl_plano_qualificado,    ds_tipo_renda,    vl_carencia_inicial_resgate,    vl_carencia_ini_port_ext,    vl_carencia_ini_port_in,    vl_carencia_entre_resgate,    vl_carencia_entre_port_ext,    vl_atualizacao_contribuicao,    vl_atualizacao_beneficio,    vl_carregamento_entrada,    vl_carregamento_saida ) VALUES (        'ICATU SEG DURATION FI RF',     '590',        NULL     ,         '04511286000120'    ,         'PGIGP'  ,         'ICATU SEG DURATION FI RF'   ,         'Não há'    ,        'Vanguarda.jpg'    ,        'É um fundo que compra basicamente títulos públicos e privados indexados à inflação. O fundo busca ter exposição tanto a IGP-M quanto IPCA. Apresenta volatilidade elevada apesar de ser de renda fixa. Essa característica deve-se a necessidade de marcar a mercado os títulos que compõem a carteira do fundo, isto é, os papéis devem ter o seu valor de venda atualizados diariamente mesmo que sejam carregados até o vencimento. As NTN-Bs por possuírem um caráter pré-fixado apresentam variação no seu preço unitário conforme alterações nas expectativas de juros futuras, de maneira geral, se há expectativa de subida nas taxas de juros os preços dos títulos caem e se há expectativa de queda nas taxas de juros os preços sobem.'      ,        'ICATU VANGUARDA GESTÃO DE RECURSOS LTDA'    ,        'ICATU VANGUARDA GESTÃO DE RECURSOS LTDA'    ,        '1,50'    ,        '1,50'    ,        '-'    ,        'N'    ,        'Renda Mensal Temporária 15 Anos'    ,        '60'    ,        '60'    ,        null    ,        '60'    ,        '60'    ,        'Anualmente pelo IPCA'    ,        'Anualmente pelo IPCA'    ,        null    ,        null         );
