 INSERT INTO tb_fundo (    nm_fundo,    id,    vl_taf,    nu_cnpj,    cd_fundo_seg,    nm_fundo_reduzido,    dsc_performance,    logo,    ds_fundo,    ds_gestor,    nm_gestor,    vl_taxa_adm_maxima,    vl_taxa_adm_minima,    dsc_lmax_tx_performance,    fl_plano_qualificado,    ds_tipo_renda,    vl_carencia_inicial_resgate,    vl_carencia_ini_port_ext,    vl_carencia_ini_port_in,    vl_carencia_entre_resgate,    vl_carencia_entre_port_ext,    vl_atualizacao_contribuicao,    vl_atualizacao_beneficio,    vl_carregamento_entrada,    vl_carregamento_saida ) VALUES (        'CANVAS ICATU PREV FIC FI MULT PREV',     '513',        NULL     ,         '24405282000175'    ,         'CANVA'  ,         'CANVAS ICATU PREV FIC FI MULT PREV'   ,         'Não há'    ,        'canvas.jpg'    ,        'O objetivo do fundo CANVAS ICATU PREVIDÊNCIA FIC FI MULT PREV é preservação de capital com geração de retorno absoluto no longo prazo. Os investimentos são feitos apenas em mercados líquidos, com foco na estratégia multimercado macro e uso seletivo de crédito. A equipe da Canvas Capital tem um histórico de 10 anos com forte geração de ganhos em diversos mercados, dentro de um processo de investimento disciplinado e de uma plataforma robusta de governança corporativa e compliance.'      ,        'CANVAS CAPITAL S.A.'    ,        'CANVAS CAPITAL S.A.'    ,        '2,00'    ,        '2,00'    ,        '-'    ,        'N'    ,        'Renda Mensal Temporária 15 Anos'    ,        '60'    ,        '60'    ,        null    ,        '60'    ,        '60'    ,        'Anualmente pelo IPCA'    ,        'Anualmente pelo IPCA'    ,        null    ,        null         );
 INSERT INTO tb_fundo (    nm_fundo,    id,    vl_taf,    nu_cnpj,    cd_fundo_seg,    nm_fundo_reduzido,    dsc_performance,    logo,    ds_fundo,    ds_gestor,    nm_gestor,    vl_taxa_adm_maxima,    vl_taxa_adm_minima,    dsc_lmax_tx_performance,    fl_plano_qualificado,    ds_tipo_renda,    vl_carencia_inicial_resgate,    vl_carencia_ini_port_ext,    vl_carencia_ini_port_in,    vl_carencia_entre_resgate,    vl_carencia_entre_port_ext,    vl_atualizacao_contribuicao,    vl_atualizacao_beneficio,    vl_carregamento_entrada,    vl_carregamento_saida ) VALUES (        'ICATU SEG GLOBAL EQUITY INCOME 10 FI MUL',     '533',        NULL     ,         '28557951000185'    ,         'GLOBA'  ,         'ICATU SEG GLOBAL EQUITY INCOME 10 FI MUL'   ,         'Não há'    ,        'Vanguarda.jpg'    ,        'O fundo nasceu da parceria entre a Icatu Seguros e BlackRock. O fundo investe em uma carteira diversificada composta por títulos atrelados à inflação com vencimento inferior a 5 anos e de ações globais de alta qualidade (até 10% do PL). A gestão do fundo fica a cargo da Icatu Vanguarda que faz a alocação da parte de renda fixa brasileira e investe, via veículos locais, em uma estratégia de ações globais da BlackRock. A diversificação é o grande diferencial do produto, a estratégia gerida pela BlackRock oferece uma diversificação geográfica e setorial muito mais ampla que o investimento em renda variável local. Além disso, a alocação em ativos atrelados a índice de preços proporciona ganho real e proteção contra a inflação. Fatores que tornam o fundo atrativo para investimento de longo prazo.'      ,        'ICATU VANGUARDA GESTÃO DE RECURSOS LTDA'    ,        'ICATU VANGUARDA GESTÃO DE RECURSOS LTDA'    ,        '1,10'    ,        '1,00'    ,        '-'    ,        'N'    ,        'Renda Mensal Temporária 15 Anos'    ,        '60'    ,        '60'    ,        null    ,        '60'    ,        '60'    ,        'Anualmente pelo IPCA'    ,        'Anualmente pelo IPCA'    ,        null    ,        null         );
 INSERT INTO tb_fundo (    nm_fundo,    id,    vl_taf,    nu_cnpj,    cd_fundo_seg,    nm_fundo_reduzido,    dsc_performance,    logo,    ds_fundo,    ds_gestor,    nm_gestor,    vl_taxa_adm_maxima,    vl_taxa_adm_minima,    dsc_lmax_tx_performance,    fl_plano_qualificado,    ds_tipo_renda,    vl_carencia_inicial_resgate,    vl_carencia_ini_port_ext,    vl_carencia_ini_port_in,    vl_carencia_entre_resgate,    vl_carencia_entre_port_ext,    vl_atualizacao_contribuicao,    vl_atualizacao_beneficio,    vl_carregamento_entrada,    vl_carregamento_saida ) VALUES (        'TRUXT MACRO PREV ICATU FIC FIM',     '23435',        NULL     ,         '29733120000180'    ,         'TRUXT'  ,         'TRUXT MACRO PREV ICATU FIC FIM'   ,         'Não há'    ,        'TRUXT.jpg'    ,        'Fundo de previdência com gestão da Truxt Investimentos. Trata-se de um fundo previdenciário multimercado com estratégia macro que busca replicar a mesma carteira do fundo TRUXT MACRO respeitando as restrições legais da regulação de previdência. A estratégia macro alia a análise fundamentalista, considerando os cenários macroeconômico de médio e longo prazo e identificação de tendências dos ciclos econômicos, com a visão oportunistíca e o monitoramento constante do risco. O fundo tem por objetivo a geração de retorno no longo prazo e a preservação do capital do participante a partir de uma carteira com flexibilidade da alocação de risco total, entre os diversos mercados e estratégias.'      ,        'TRUXT INVESTIMENTOS LTDA.'    ,        'TRUXT INVESTIMENTOS LTDA.'    ,        '2,05'    ,        '1,97'    ,        '-'    ,        'N'    ,        'Renda Mensal Temporária 15 Anos'    ,        '60'    ,        '60'    ,        null    ,        '60'    ,        '60'    ,        'Anualmente pelo IPCA'    ,        'Anualmente pelo IPCA'    ,        null    ,        null         );
